Error - 2014-06-02 15:00:22 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('720087913', 'JP', 'jp.co.yahoo.sports.npb.textlive', 'スポナビ プロ野球速報', 'http://a1379.phobos.apple.com/us/r30/Purple6/v4/1c/26/11/1c261106-8ef5-971e-54ee-3171193aaf3f/mzl.sujawnqy.53x53-50.png', 'http://a1895.phobos.apple.com/us/r30/Purple6/v4/1c/26/11/1c261106-8ef5-971e-54ee-3171193aaf3f/mzl.sujawnqy.75x75-65.png', 'http://a308.phobos.apple.com/us/r30/Purple6/v4/1c/26/11/1c261106-8ef5-971e-54ee-3171193aaf3f/mzl.sujawnqy.100x100-75.png', '0.00000', 'JPY', 'Yahoo Japan Corp.', 'iOS_Apps', '6004', 'topfreeapplications', 0, '【スポーツカテゴリランキング１位獲得】\nプロ野球の「一球速報」があなたのスマホに！\n\n■無料で一球ごとの速報が見られる唯一のアプリ\nアプリを起動するだけで、各試合のスコアはもちろん、現在対戦中の投手・打者やカウント、走者状況などが一目瞭然！\n試合詳細ページでは一球ごとの速報が見られます。\n各ページとも自動で更新されるので（秒数変更・オフ設定も可能）、デスクに置いたままでも最新の情報がチェックできます。\n\n■予告先発、対戦成績など試合前情報も充実！\n試合前には、予告先発投手や見どころ、チームの対戦成績を掲載。そのほか、日程・結果や順位表、個人成績、ニュースなど、このアプリがあれば様々な情報にもアクセス可能です！\n交流戦やプレーオフにも対応していますので、シーズンを通してご利用いただけます。\n\n■見やすく、使いやすいシンプルなアプリ\n面倒な会員登録やログインなどは一切不要！\nシンプルで見やすく、使いやすいアプリとして、昨シーズンは多くのユーザーの皆さまから好評をいただきました。\n今後も随時アップデート予定ですので、今シーズンもご期待ください！\n\n＜主な機能＞\n・お気に入りチーム設定機能\nトップページ（試合一覧）の上段にお気に入りチームの試合を固定表示します。\n\n・自動更新機能\nトップページ、試合詳細ページともに15秒ごとに自動で更新します。設定ページで秒数の切り替え（30秒、60秒）やオフ（手動更新）に変更することも可能です。\n\n・オーダー表示機能\nスコアボード下のチーム名（▼ボタン）を押すと、現時点のオーダーが表示されます。\n\n・テキスト開閉機能\n各テキスト速報（打席結果）の右端の▼ボタンを押すと、一球ごとの結果情報が開いて表示され、再度▲ボタンを押すと閉じることができます。\n\n・動画リンク機能\nパ・リーグの試合において、各テキスト速報（打席結果）の【動画を見る】リンクを押すと、その打席のハイライト動画を視聴できます。', '2013-10-24 09:42:58', '2014-06-02 15:00:21')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
