Error - 2014-06-02 15:00:47 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('413618155', 'JP', 'jp.mcdonalds.coupon', 'マクドナルド公式アプリ', 'http://a246.phobos.apple.com/us/r30/Purple2/v4/1e/7b/ce/1e7bcec0-8d1a-d80a-7919-e0bdbb210e7c/mzl.xfqozwgk.53x53-50.png', 'http://a762.phobos.apple.com/us/r30/Purple2/v4/1e/7b/ce/1e7bcec0-8d1a-d80a-7919-e0bdbb210e7c/mzl.xfqozwgk.75x75-65.png', 'http://a951.phobos.apple.com/us/r30/Purple2/v4/1e/7b/ce/1e7bcec0-8d1a-d80a-7919-e0bdbb210e7c/mzl.xfqozwgk.100x100-75.png', '0.00000', 'JPY', '日本マクドナルド株式会社', 'iOS_Apps', '6023', 'topfreeapplications', 0, '日本マクドナルド株式会社が提供する店舗検索やお得なクーポンなどをお楽しみいただけるマクドナルド公式アプリです。\n本アプリのご利用には会員登録が必要です。アプリダウンロード後に、会員登録(無料)をして、ご利用ください。\n\n【アプリが正常に動かない場合】\nたいへんお手数をおかけしますが、以下をお試しください。\n1) アプリを削除する → 端末上でアプリを再インストール\n2) アプリを削除する → iTunes上でアプリを再インストール\n\n【ご提供サービス】\n -店舗検索\n -見せるクーポン\n -週刊マック\n -FUNコンテンツ\n -マイページ\n\n【ダウンロード後によくある質問】\n Q.会員登録メールが来ないのですが、どうすればよいですか?\n A.しばらくお待ちください。 しばらくたってもメールが届かない場合、迷惑メール対策の設定を確認してください。ドメイン指定受信をしている場合、受信設定が必要です。 【sp.mdj.jp】を受信可能にしてください。 また、ご利用のメールソフトによって、メールが迷惑メールフォルダに振り分けられている可能性がありますので、迷惑メールフォルダを確認してください。\n\n Q.マクドナルドの公式携帯サイトの会員IDではログインできないのですか?\n A.ログインできません。スマートフォン向けサービスは公式携帯サイトとは別サービスになっております。\n\n【対応OSバージョン】\n 4.3以上\n\n【動作対象端末】\n iPhone3GS\n iPhone4\n iPhone4S\n iPhone5\n iPhone5c\n iPhone5s\n\n【iOS 4.2以前の端末をお使いの会員様へ】\n2013年4月現在、iPhone版「マクドナルド公式アプリ」の対応iOSバージョンは4.0以上とさせていただいておりますが、今後の運用を進めていくうえで、iOS4.2以前の環境に対応することが難しいと判断したため、2013年5月13日以降、対応iOSバージョンを4.3以上と変更させていただきました。\n\n■iOS4.2以前をお使いの方■\n※最新のiOSへアップデートをお願いいたします。\n　iOSをアップデートしない場合\n　・公式アプリのアップデートができません。\n　・店舗情報を更新できません。', '2011-06-17 16:00:00', '2014-06-02 15:00:47')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
