ion.php on line 175
Error - 2014-06-02 15:00:53 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('364543737', 'JP', 'com.intsig.camcard.ja2', 'CamCard - 名刺認識管理', 'http://a1978.phobos.apple.com/us/r30/Purple4/v4/3a/f8/3a/3af83aa4-4b8f-d410-77f8-13458b34fa75/mzl.vgmpnbwv.53x53-50.png', 'http://a846.phobos.apple.com/us/r30/Purple4/v4/3a/f8/3a/3af83aa4-4b8f-d410-77f8-13458b34fa75/mzl.vgmpnbwv.75x75-65.png', 'http://a283.phobos.apple.com/us/r30/Purple4/v4/3a/f8/3a/3af83aa4-4b8f-d410-77f8-13458b34fa75/mzl.vgmpnbwv.100x100-75.png', '100.00000', 'JPY', 'IntSig Information Co.,Ltd', 'iOS_Apps', '6000', 'toppaidapplications', 0, '【タイムサービス】CamCard完全版が90%オフ！ダウンロードは今でしょ！\n\n* 全世界5000万人以上のエリートビジネスマンが使用する名刺管理アプリ！\n*「世界最高レベルのソフト開発会社」——Google\n* App Store 2011、2012年度ナンバー１ビジネスアプリケーション\n* 「CamCardはスマートフォン技術を使い、如何に連絡先情報の保存と共有が時代に追いついたかを教えてくれます。」——BBC News\n*「間違いなくCamCardは名刺認識アプリのナンバーワン！」――ニューヨーク•タイムズ紙\n*「一瞬で営業情報を保存、営業担当に必要なアプリ」——Inc.com\n*「大量の名刺を一気に携帯電話に入力、非常に便利に利用可能！」——CBS TV\n\nCamCardは最もプロフェッショナルな名刺認識、管理アプリです。様々な言語の名刺を迅速かつ正確に認識し、自動でアドレス帳に保存できます。名刺に画像、音声、ビデオ、添付ファイルを追加することで個人、製品、会社を全方位から紹介できます。\n\n\n-------特別なコア技術、世界最先端-------\n*名刺を瞬間で認識してスマートに管理し、迅速的に携帯電話のアドレス帳に保存\n*名刺にイメージ、画像、音声、ビデオ、添付ファイルを追加\n*完璧に近い精度で世界各言語の「AR名刺」を認識\n*携帯電話、タブレット、パソコンもクラウドでいつでも情報更新\n\nサポートシステム：iPhone 3GS, iPhone 4, iPhone 4S, iPhone 5, iPod Touch 5, iPhone 5s, iPhone 5c, iPad(Retina), iPad mini\n\n\n-------機能説明-------\n【AR名刺】\n*　名刺にイメージ、画像、音声、ビデオ、添付ファイル、リンクを追加\n*　完璧に近い精度で世界各言語の「AR名刺」を認識\n*　メール、SMS、QRコードで「AR名刺」を共有\n*ウェブ端末で「AR名刺」を編集\n\n【 素早く認識】\n* 　　携帯電話で名刺を撮影、名刺情報をすぐアドレス帳に登録\n*オフラインで16種類の名刺を認識：簡体中国語、繁体中国語、英語、日本語、韓国語、ドイツ語、イタリア語、スペイン語、ポルトガル語、オランダ語、ハンガリー語、ノルウェー語、デンマーク語、フィンランド語、スウェーデン語\n*バッチ処理、メール署名、QRコード認識をサポート\n\n【気軽に編集】\n*名刺裏側画像を追加\n*名刺メモ情報を追加\n\n【スマート管理】\n* 　全画面で名刺を表示\n*名刺認識結果を携帯電話のアドレス帳や電子名刺入れ或いはGmail、Exchangeに保存\n*ソート、分類、検索、メール一括送信、エクスポート等の方法連絡先を管理\n*名刺を選択して連絡先情報によって電話、SMS送信、メール送信、名刺上のウェブサイトにアクセス、またマップで位置確認\n*パスワードで連絡先情報を保護\n\n【便利に共有】\n*メール、SMSで名刺共有\n*QRコード作成、QRコードで名刺共有\n*名刺をvCardやExcelにエクスポート\n*LinkedInの中で連絡先を検索、連絡先にLinkedIn招待を送信\n\n【クラウド同期】\n*アカウントを登録してログインすると、オンラインで連絡先情報を確認でき、誤削除した連絡先もいつでもリストア。\n*携帯電話、タブレット、パソコンもクラウドでいつでも名刺情報を同期、更新\n\n名刺認識管理(CamCard)を気に入っていただけましたら、或いはご意見がございましたら、少しお時間をいただき、名刺認識管理(CamCard)のご評価或いはisupport@intsig.comまでご連絡をお願いします。商品の改善へのご協力により更に多くの優れた機能を体験していただけますよう努力して参ります。\n\n-----アドバイス-----\n弊社製品ご使用の際に、よりよい効果を得るため：\n*画像が鮮明であればそれだけ認識精度も高まります。「明るい場所で、極力手ぶれの少ない状態で撮影してください」\n*画像が大きければそれだけ認識精度も高まります。「撮影する際には画像が大きくディスプレイに表示されるようにしてください」\n\nTwitterで私達をフォロー@camcardintsig\nFacebookで私達をフォローCamCard\nGoogle+で私達をフォローCamCard\n\n-------弊社の他のアプリケーション-------\n------- CamScanner \n* 　　App Store 2011年度セールスナンバー１アプリケーション\n* 　　App Store 2012年度セールスナンバー１有料アプリケーション\n*全世界4000万人以上のユーザー、3000以上の教育機関、60以上の国・地域で使用されるスキャンアプリ！\n*｢CamScannerは特別な画像処理技術でドキュメントがより読みやすくなる｣—Makeuseof.com\n*｢間違いなくCamScannerは携帯電話で一番のスキャナーアプリ｣—CNET.com\n\n\n-------CamDictionary\n*  App Store 2011年度ナンバー１人気辞書/辞典アプリケーション\n*  App Store 2012年度ナンバー１有料アプリケーション', '2010-04-06 20:57:23', '2014-06-02 15:00:53')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
Error - 2014-06-02 15:00:56 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('495546638', 'JP', 'net.morethan.Thermo', '温湿度計 (気圧計,不快指数)', 'http://a1752.phobos.apple.com/us/r30/Purple/v4/35/33/7c/35337c75-a061-07f2-2b67-35d2f3ffac09/mzl.pngujpnn.53x53-50.png', 'http://a620.phobos.apple.com/us/r30/Purple/v4/35/33/7c/35337c75-a061-07f2-2b67-35d2f3ffac09/mzl.pngujpnn.75x75-65.png', 'http://a585.phobos.apple.com/us/r30/Purple/v4/35/33/7c/35337c75-a061-07f2-2b67-35d2f3ffac09/mzl.pngujpnn.100x100-75.png', '100.00000', 'JPY', 'morethan Apps', 'iOS_Apps', '6001', 'toppaidapplications', 0, '温度, 湿度, 気圧, 不快指数を一目でチェック！\n\n毎日のアナログ感性のデザインをお楽しみください。\n\"温湿度計\"は、位置に基づいて現地外気温と体感温度、湿度、気圧, 不快指数を表示してくれるアプリです。 \n\n- 小数点ユニットの温度計（摂氏/華氏） \n- 湿度計 \n- 気圧計（hPa/ inchHg） \n- 不快指数測定 \n- マルチ天気APIのサポート (Weather Underground/OpenWeatherMap） \n\n* GPSが内蔵されているiPhone/ iPad 3G LTEほど、より正確な気温/湿度の測定が可能です。 \n\n- 体感温度（The wind chill temperature）は、Joint Action Group for Temperature Indices（JAG/ TI）会議で新たに発表され、現在、米国やカナダなど北米の国々を中心に最新の広く使われている体感温度の算出式を使用しています。 \n\n- 不快指数はThom（1957）が提唱したもので、気温と湿度の組み合わせで人が感じる温度を表現した数値です。', '2012-01-26 08:13:43', '2014-06-02 15:00:56')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
Error - 2014-06-02 15:00:57 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('415468221', 'JP', 'com.gmail.shibuym.ContactsBook', '連絡先＋', 'http://a279.phobos.apple.com/us/r30/Purple6/v4/cd/95/20/cd95203c-bc4e-033d-e60e-384f8c21f626/mzl.zztmxfny.53x53-50.png', 'http://a1147.phobos.apple.com/us/r30/Purple6/v4/cd/95/20/cd95203c-bc4e-033d-e60e-384f8c21f626/mzl.zztmxfny.75x75-65.png', 'http://a312.phobos.apple.com/us/r30/Purple6/v4/cd/95/20/cd95203c-bc4e-033d-e60e-384f8c21f626/mzl.zztmxfny.100x100-75.png', '100.00000', 'JPY', 'SHIBUYA Masanori', 'iOS_Apps', '6002', 'toppaidapplications', 0, '「連絡先+」は、連絡先のグループ分けやメールの一斉送信ができるアドレス帳アプリです。\nタブとドラッグ&ドロップで簡単に連絡先を整理できます。\n\n◆AppStore Best of 2013 有料総合9位になりました。\n◆ランキング獲得　AppStore 2012年年間有料総合4位、2011年年間有料総合9位、iPhone有料総合2位、カテゴリ1位、オールタイムトップ25 14位\n◆iOS 7に対応 \n\n連絡先＋の使い方\n\n・グループを作成する\n　アプリケーションを起動すると、右側にタブが並んでいます。グループを作成するためには、その下の「+」ボタンを押してください。\n\n・連絡先をグループに追加する\n　連絡先を「ドラッグ&ドロップ」でグループに分類します。\n\n　[ドラッグ&ドロップの方法]\n　　移動したい連絡先を長押しします。連絡先が浮かびあがったら、グループの「タブ」の上まで動かして指を離してください。\n\n・メールを一斉送信する\n　グループを選択して、メールボタンを押してください。メールアドレスをタップして「To(送信する)」/「×(送信しない)」 を切替えてください。\n\n・連絡先リストを整理する\n　連絡先には、会社名や写真を表示できます。\n連絡先は通常は名前の順に並びますが、会社名/色/登録日/誕生日の順で並べたり、任意の順序に並べることができます。\nまた、連絡先に目印として色をつけることができます。\n\n・連絡先を検索する\n氏名、会社名、メモ、電話番号、メールアドレス、住所、ニックネームで検索できます。\n\n・編集モード\n　編集モードでは、複数の連絡先をまとめてグループ分けできます。\n\n　[複数の連絡先をまとめてドラッグ&ドロップ]\n　「編集」ボタンを押し、移動したい連絡先をタップしてチェックマークをつけた後、連絡先をドラッグしてください。\n\n・その他の機能\n -Sparrow、デコメーラー、ibisMailでグループメール送信 \n -050 plus、050 plus for Biz、AGEphone、Acrobits Softphone、SMARTalkで電話発信 \n -複数の連絡先をまとめて送信 \n -プレフィックス機能\n　184、186のような番号をつけて電話を発信できます。プレフィックスの種類は自由に追加できます。\n\n◆お知らせ\n\n※「連絡先＋」は、純正の「連絡先」を参照して表示しています。「連絡先＋」のアップデートでデータが消去されることはありませんが、何かの問題で純正の連絡先アプリのデータが消えると「連絡先＋」からも消えてしまいます。iOSアップデートや同期の問題で連絡先が消えてしまう事例がありますので、iTunes/iCloudでバックアップして頂くようお願いします。「連絡先＋」を使って簡単にメールでバックアップできますので併せてご利用ください。\n\n※auのiPhoneをお使いの場合、連絡先のデフォルトアカウントが「◎Eメール(ezweb.ne.jp)」になっていないことをご確認ください。グループ分けができない、連絡先が消えるなどの問題の原因となります。お問い合わせ頂くトラブルの多くはこれが原因です。詳細は「メールアプリでのEメール(@ezweb.ne.jp)利用設定」STEP3をご確認ください。\nhttp://www.au.kddi.com/iphone/support/guide/1.html\n\n※連絡先が消えるなどお困りのことがあれば、設定＞問い合わせ からお問い合わせください。AppStoreのレビューには回答ができません。\n\n◆注意事項\n\n※このアプリを使っての連絡先、グループの変更はiPhone標準の連絡先に反映されます。グループのアイコン/色/順序、連絡先の色/順序はこのアプリ独自の機能のため標準連絡先には反映されません。\n\n※Exchangeを使って同期している連絡先をグループ分けするには「ローカルグループ」を使用してください。ローカルグループはiPhone標準連絡先に反映されません。\n\n※ローカルグループは、グループと連絡先の関連づけに氏名と会社名を使用しています。そのため、氏名／会社名が完全に一致した連絡先が複数ある場合、グループ分けが正しく動作しない場合があります。\n\n※OSの制限により、カスタム着信音の設定には対応しておりません。\n\n※iOS6ではFacebookの友達が自動的に連絡先に追加されます。これを解除するためには、設定>Facebook>アカウントの使用を許可するApp:連絡先をオフにしてください。', '2011-02-20 10:34:58', '2014-06-02 15:00:57')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
Error - 2014-06-02 15:00:58 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('382069612', 'JP', 'se.resenatverket.FlightRadar24', 'Flightradar24 Pro', 'http://a158.phobos.apple.com/us/r30/Purple6/v4/1f/00/ca/1f00caed-74fe-6d38-d092-b6031ee53303/mzl.nnofnfhj.53x53-50.png', 'http://a1026.phobos.apple.com/us/r30/Purple6/v4/1f/00/ca/1f00caed-74fe-6d38-d092-b6031ee53303/mzl.nnofnfhj.75x75-65.png', 'http://a1983.phobos.apple.com/us/r30/Purple6/v4/1f/00/ca/1f00caed-74fe-6d38-d092-b6031ee53303/mzl.nnofnfhj.100x100-75.png', '300.00000', 'JPY', 'Flightradar24 AB', 'iOS_Apps', '6003', 'toppaidapplications', 0, 'あなたの携帯やiPadをエアートラフィックレーダーに変えて、日本の周りや世界中を飛ぶ飛行機をリアルタイムで詳細な地図上で見てみましょう。アップル機器を空を飛んでいる飛行機にかざして、行き先その他を調べましょう。何百万人ものひとがなぜ Flightradar24を愛用しているのか。今日、ご自分で体験してみませんか。\n\nFlightradar2 アプリが25カ国以上でベストセラーとなった、また140カ国以上 (日本、米国、英国、ドイツその他) でベストセラーの旅行アプリとなった優れた機能には以下があります: \n* 詳細な地図上を飛行機が移動するのをリアルタイムでご覧になれます\n* 機器を空にかざすだけで、上空を飛んでいる飛行機を識別できます (GPS 搭載の機器が必要です)\n* 飛行機のパイロットがなにを見ているか、リアルタイムで 3Dで体験できます (iPhone 4S, iPad 2, iPod Touch 第5世代、+ iOS 6.0 以降のバージョンが必要となります)\n* 飛行機をタップすると、ルートや予想到着時間、実際の離陸時間、機種、速度、高度や高解像度の画像といった、全体的なフライトと機体の情報が表示されます\n* 便名や空港、航空会社で、個別のフライトを簡単に探せます\n* 航空会社、期待、高度、速度その他で簡単にフィルタリングできます\n* 簡単にお気に入りに追加でき、関心のある地域を迅速にナビゲーションできます\n* 機器を主要な航空の発着案内に合わせると、リアルタイムでフライトステータス更新と、現在の空港周辺の天候条件を見ることがをできます (アプリ内で別途ご購入いただいた場合)\n* リアリスティックな機体の記号 (アプリ内で別途ご購入\n* 航空会社、機種、便名または登録に基づいたカスタマイズされたアラートを設定する(アプリ内で別途ご購入) \n\nどのように機能するか\n今日、ほとんどの機体には、いわゆる位置データを送信する、いわゆるADS-Bのトランスポンダーが搭載されています。Flightradar24 は急成長中のネットワークで、世界中に数千のグループステーションを持ち、アプリ内の地図で機体が移動するのを示すこのデータを受け取ります。マルチラテレーションの助けを借りて、Flightradar24 はカバーする地域を拡大中であり、 ADS-B トランスポンダーを持たない機体の位置も計算可能となっています。\n\nアプリでは、米国連邦航空局 (FAA) からの直接的な情報供与により、従来のレーダーデータも利用されています。このデータは、米国とカナダの全空域をほぼリアルタイムでカバーします。\n\n***重要な通知***\nFlightradar24 アプリは英語で表記されています。が、テキストはほとんどなく、追加テキストが必要な際にも可能な限り周知の記号を使っています。\n\n特別の地域の飛行機の往来追跡にのみご興味がある場合には、アプリをご購入前に Flightradar24.com にてご確認ください。Flightradar24 は、他に類を見ないレベルの世界中の機体位置データを提供していますが、カバーされていない地域もあります。 \n\nカバレッジは随時変更される場合があります。\n\nFLIGHTRADAR24 にコネクトしよう\nFlightradar24 を Facebook でイイネ！して、Twitter でフォローしよう。\n\nヘルプ & サポート\nforum.flightradar24.com/threads/89-Important-Read-this-before-you-ask-questions\nflightradar24.com/contact-us.\n\n免責\nこのアプリの使用は、厳密に娯楽目的に限られています。特に、あなた自身や他の人々の命にかかわるような活動は、使用目的から除外します。いかなる状況においても、このアプリの開発者は、データの使用や解釈により、または本同意に反する使用から起こる事柄に対し、責任を負いません。弊社は、アプリ内のユーザーの活動を匿名で追跡・報告する権利を有します。', '2010-07-31 13:29:46', '2014-06-02 15:00:58')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
Error - 2014-06-02 15:00:59 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('378485879', 'JP', 'jp.co.wspace.GolfSwingCheck', 'ゴルフ・スイングチェック', 'http://a843.phobos.apple.com/us/r30/Purple4/v4/d3/65/40/d365402c-9a43-99c4-29ec-9136fdd0c088/mzl.lrmvszkb.53x53-50.png', 'http://a1359.phobos.apple.com/us/r30/Purple4/v4/d3/65/40/d365402c-9a43-99c4-29ec-9136fdd0c088/mzl.lrmvszkb.75x75-65.png', 'http://a1532.phobos.apple.com/us/r30/Purple4/v4/d3/65/40/d365402c-9a43-99c4-29ec-9136fdd0c088/mzl.lrmvszkb.100x100-75.png', '200.00000', 'JPY', 'WineSpace inc.', 'iOS_Apps', '6004', 'toppaidapplications', 0, '「ゴルフ・スイングチェック」は簡単な操作で(サクサクと)スイングのチェックが出来るアプリです(企画・製作:Revin Inc.)。美しいスイング → スイング精度の向上 → スコアーUPのお役に立てます。\n\n※※※今回のアップデートで、保存一覧のスイングのサムネイル画像が横に表示される不具合がありますが、現在対応中です。もうしばらくお待ちください。※※※\n\n＊＊＊TV番組でたくさんの方々にご推薦頂きました!ゴルフ部の高校生のみなさんまで…ありがとうございました。＊＊＊\n＊ iTunes Rewind 2010 トップトレンドの栄誉を獲得! スポーツ パーソナルトレーナー ＊\n\n一人でも、仲間とでも録画ができます。チェックポイント(アドレス、テイクバック、トップ、インパクト、オンプレーン等)を発見しましょう。\n\n◆長い間、有料トップにランキング!ありがとうございます!◆\n\n◆◆◆対応機種◆◆◆\niPhone 3GS, 4, 4S, 5, 5S, 5C 及び new iPod touch\n\n◆◆◆機能説明◆◆◆\n＊録画:赤いボタンを押してスイングを撮影します(最大10秒自動停止)。\n \n＊セルフタイマー:画面右上のタイマーOFFのボタンを押すと15秒、20秒のタイマー設定が出来ます。\n\n＊動画の編集、保存:録画終了すると自動的に編集画面になります。タイムラインで確認して前後に不要なところがあればタイムラインボタンをスライドさせてハサミボタンを押すと、タイムラインボタンより前後の画像がカットされます。\n\n＊画面に線・○を記入:画面上の色選択ボタンでお好きな色を選び指で自由に線と○を記入します(線と○合計10本までOK)。記入した線は、タップすることで、移動、拡大、回転することができます。\n注:線や○をどこに書けばいいかわからない場合は「おススメチェックのポイント」をご覧ください。\n\n＊再生:再生ボタンを押すと通常の1/2のスロー再生がスタートします\n\n＊アクションボタン:\n1:タイトル(名前、使用クラブ等)編集\n2:動画の前後の不要部分をカット\n3:動画をチェックラインを入れたままメールに添付して送信(仲間を撮影した時に喜ばれます)\n注:メールに添付出来るのは1MBの制限がある場合があります。\n4:カメラロールへスイング動画の書き出し\n5:簡単シェア機能(YouTube、Facebook)\n※操作後、URLがクリップボードにコピーされています。\n\n\nアプリ内のスイング一覧画面右下の「使い方、ヘルプ」により詳しい説明を載せております。\n\n◆◆◆おススメチェックのポイント◆◆◆\n試作の段階からいろいろご意見頂き基本的なチェックポイントを何点かご紹介いたしますので、よろしければご参考にして下さい。\n\n1、右後方から録画した場合\nアドレスの画面でラインを肩→ボール、へそ→ボールの2本の直線をひき、頭の部分に○を記入\n＊チェックポイント:2本線からクラブヘッドがはみ出てないかチェック。インパクトまで頭が丸からずれていないかチェック(インパクト時は少々頭が沈んでいるのはOK)\n\n2、正面から録画した場合\nアドレスの画面で両足の中心から垂直に2本線、頭に○、両ひざに○を記入\n＊チェックポイント:トップの位置で頭、ひざ、体全体が右に(画面では左)に大きくずれていないかチェック。インパクトで左ひじが曲がっていないチェック\n\n上記はほんの一例です、レッスン書やゴルフ雑誌、レッスンプロや上級者の方の意見を参考にベストスコアー更新されることを祈念いたします。', '2010-09-01 16:00:00', '2014-06-02 15:00:59')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
