Error - 2014-06-02 15:01:18 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('680170305', 'JP', 'net.7minworkoutapp', '7 分間エクササイズ - 7 Minute Workout Challenge', 'http://a1237.phobos.apple.com/us/r30/Purple4/v4/d9/79/e9/d979e9d7-25ef-206f-cd4d-1f2a55d76fc8/mzl.oyljxfjm.53x53-50.png', 'http://a1753.phobos.apple.com/us/r30/Purple4/v4/d9/79/e9/d979e9d7-25ef-206f-cd4d-1f2a55d76fc8/mzl.oyljxfjm.75x75-65.png', 'http://a1958.phobos.apple.com/us/r30/Purple4/v4/d9/79/e9/d979e9d7-25ef-206f-cd4d-1f2a55d76fc8/mzl.oyljxfjm.100x100-75.png', '200.00000', 'JPY', 'Fitness Guide Inc', 'iOS_Apps', '6013', 'toppaidapplications', 0, '「7 分間ワークアウト」はリサーチに基づいたワークアウトプログラムです。世界的なヒットを記録しています! \n\n論文誌 ACSM にも掲載され、ニューヨークタイムズによって人気を獲得した「7分間ワークアウト」はシンプルですが、効果的です。 \n\n30 秒間行うワークアウトを 10 秒間隔で行う 12 のエクササイズを研究者が厳選。休みを少なく入れた高集中トレーニングで、1 日のメタボリズムを高めることができ、7 分強の運動で、1 時間以上の運動量に匹敵する効果が得られます。 \n\n最も注目していただきたいのは、このエクササイズがとてもシンプルだという点です。特殊な機器は必要ありません。どこにいてもエクササイズできるのです! これで言い訳はできませんね。 \n\nこのアプリでは、研究によって裏付けられたワークアウトを行っていきます。効果を追跡し、ワークアウトを続けるうちにご褒美ももらえるようになっており、楽しく続けることができます。 \n\nアプリの機能: \n\n- おしゃれなデザイン \n- 男性と女性のトレーナーが、ビデオ、オーディオ、画像、テキストでエクササイズをご案内します \n- すべてのコンテンツが料金に含まれています (追加料金はかかりません。インターネット接続も必要ありません) \n- ウェイトトラッカーで体重を管理できます \n- アクティビティカレンダーでアクティビティを追跡できます \n- ワークアウトしながら、さまざまなアチーブメントをアンロックできます \n\n弊社はフィットネスのプロを集めアプリ開発を行っています。最高品質の製品をお届けすることに細心の注意を払っています。ご意見やご提案などは、お気軽にお寄せください。アプリは定期的に追加料金なしでアップデートしていただけます。', '2013-07-31 06:50:20', '2014-06-02 15:01:18')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
Error - 2014-06-02 15:01:19 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('793660476', 'JP', 'jp.co.spike-chunsoft.terrariajp', 'テラリア', 'http://a1941.phobos.apple.com/us/r30/Purple/v4/68/18/64/681864a9-65a7-2116-5e68-39eb4025ea59/mzl.ifscidpt.53x53-50.png', 'http://a457.phobos.apple.com/us/r30/Purple/v4/68/18/64/681864a9-65a7-2116-5e68-39eb4025ea59/mzl.ifscidpt.75x75-65.png', 'http://a1574.phobos.apple.com/us/r30/Purple/v4/68/18/64/681864a9-65a7-2116-5e68-39eb4025ea59/mzl.ifscidpt.100x100-75.png', '500.00000', 'JPY', 'Spike-Chunsoft CO, LTD.', 'iOS_Apps', '6014', 'toppaidapplications', 0, '！！！一部のポケットWiFiに端末を接続している場合、アプリが起動しないことがあるという現象が確認されています。アプリが起動しない場合、一度［機内モード］をオンにするなどして、ネットワークから切断して起動できるかどうかご確認ください。！！！ \n\n掘る、作る、戦う。遊びかたは無限大！\n\n2D横スクロール型モノづくりアクションアドベンチャー「テラリア」が、日本語に対応してiOSに登場！\n\nテラリアの世界は木や土、鉱石などのブロックで構成されており、ツルハシやオノなどを使って切り崩すことで、素材として収集できる。\n集めたブロックやモンスターが落とす素材などを使えば、アイテムを作ったり、自由な形の建造物を建てることが可能。\n新たな素材を求めて、そしてまだ見ぬ敵を求めて広大なマップを自由に散策しよう。\n\n・文字入力\n本アプリ内でのキャラクター名とワールド名の入力は、英数字にのみ対応しています。ご利用端末のキーボードをローマ字入力に切り替えて入力してください。\n\n・マルチプレイ\n本アプリは、最大4人のアドホックマルチプレイに対応しています。同じWi-Fiに接続した他のプレイヤーのワールドが、「ゲームに参加」画面に表示されます。\n\n 「テラリア」の世界をもっと知りたい方は、公式ウェブサイトをご確認ください。\n  http://www.spike-chunsoft.co.jp/terraria/app\n\nテラリアiOS版ユーザーサポート\n  support-terraria-ios@spike-chunsoft.co.jp\n※ゲームの攻略法に関するお問い合わせにはお答えいたしかねます。\n\n-------\n\nPublished by 505 Games (and Spike Chunsoft for Japan region). © 2014 Re-Logic. Mobile versions developed by Codeglue. All Rights Reserved.\n本ソフトウェアでは、フォントワークス株式会社のフォントを使用しています。フォントワークスの社名、フォントワークス、Fontworks、フォントの名称は、フォントワークス株式会社の商標または登録商標です。', '2014-05-27 16:00:00', '2014-06-02 15:01:19')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
Error - 2014-06-02 15:01:22 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('339986225', 'JP', 'com.gmail.shibuym.ExpenseBook', '支出管理', 'http://a852.phobos.apple.com/us/r30/Purple/v4/ca/bd/74/cabd7460-59cc-43a8-b73a-4678bb249482/mzl.sspnotjv.53x53-50.png', 'http://a1368.phobos.apple.com/us/r30/Purple/v4/ca/bd/74/cabd7460-59cc-43a8-b73a-4678bb249482/mzl.sspnotjv.75x75-65.png', 'http://a341.phobos.apple.com/us/r30/Purple/v4/ca/bd/74/cabd7460-59cc-43a8-b73a-4678bb249482/mzl.sspnotjv.100x100-75.png', '100.00000', 'JPY', 'SHIBUYA Masanori', 'iOS_Apps', '6015', 'toppaidapplications', 0, '「支出管理」は、予算を立てて毎月の支出を管理するアプリケーションです。\n家計やおこづかい、経費などの管理にお役立てください。\n\n◆iOS 7でお使いいただけます\n◆ランキング獲得　AppStoreオールタイムトップ25 10位、2010年年間有料総合4位、 2011年年間有料総合27位、iPhone有料総合1位、カテゴリ1位\n\n\n[支出管理の使い方]\n\n1. 予算をたてる\n計画的に貯金をするためには、あらかじめ貯金を天引きしてしまうのが確実です。毎月の大体の収入から、貯金したい金額と固定支出(家賃やローン、保険など)を引いてみましょう。それが一ヶ月に自由に使える予算です。\n\n2. 支出をコントロールする\n一ヶ月間心がけることは2つだけです。\n\n*お金を使ったらすぐに「支出管理」に記録する\nお金を使ったら忘れないうちにiPhone/iPod touchに記録しましょう。「支出管理」には、すばやく記録する工夫がたくさんあります。例えば、レシートや品物の写真を撮影できます。よくある支出をテンプレートにしておけば2タップで記録できます。\n\n*予算線を超えないよう気をつける\n”日別の推移”グラフで、毎日の支出が積み上がる様子が確認できます。斜めの予算線は、その日までに使って良いお金です。この線を超えてしまいそうになったら、少し我慢して考え直してみてください。\n\n3. 振り返る\n1ヶ月が終わったら結果を振り返ってみましょう。グラフや表で予算と結果を比較すると、予算と合わないことがあるかもしれません。次の月はもっと正確に予算をたてることが出来るでしょう。無駄に気づき、予算を削れる部分が見つかるかもしれません。\nこれで1ヶ月が終わり、次の月、また1から繰り返します。\n\n「支出管理」には、分析のためのタグ等この他にも便利な機能がたくさんあります。\n\n「支出管理」に蓄積した大切なデータや写真は、いつでも簡単にGoogleドキュメントに送って安全に保管することができます。たとえあなたのiPhoneが壊れても、買い替えても、データを引き継ぐことができます。安心して末永くお使いください。\n\n[主な機能]\n\n予算\n月の開始日設定\n分類と予算のカスタマイズ\n標準と異なる月は個別に月別予算を設定可能\n\n記録\nスライダーによる金額入力\n電卓による金額入力(金額をタップ)\nカレンダーで日付入力\n写真の添付\nテンプレート\n\nグラフ\n4種類のグラフ\nグラフにタッチすると明細が見られます\n\n表\n4種類の表\n\n検索\n6つの条件(期間,金額,分類,名前,タグ,メモ)の組み合わせで支出項目を抽出できます。\n\nタグ\n支出にタグ付けし、表やグラフで集計できます。\n\n外部連携\nGoogleドキュメント連携\n\n※おしらせ\n・初期設定ではアプリ終了後1分間はパスコードロックされません。すぐにロックするには”アプリ切替時のロック”の設定を変更してください。\n・ご質問や不具合のご報告はサポートサイトをご利用ください。', '2009-11-20 05:25:02', '2014-06-02 15:01:22')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
Error - 2014-06-02 15:01:23 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('484090401', 'JP', 'com.elokence.akinator', 'Akinator the Genie', 'http://a1905.phobos.apple.com/us/r30/Purple6/v4/e1/ae/7d/e1ae7da5-0968-e04b-6fd4-eca2cbb6b9c4/mzl.vnquvizn.53x53-50.png', 'http://a421.phobos.apple.com/us/r30/Purple6/v4/e1/ae/7d/e1ae7da5-0968-e04b-6fd4-eca2cbb6b9c4/mzl.vnquvizn.75x75-65.png', 'http://a210.phobos.apple.com/us/r30/Purple6/v4/e1/ae/7d/e1ae7da5-0968-e04b-6fd4-eca2cbb6b9c4/mzl.vnquvizn.100x100-75.png', '200.00000', 'JPY', 'Elokence', 'iOS_Apps', '6016', 'toppaidapplications', 0, 'MyWorldを使えば、アキネーターがもっと身近に！\nアキネーターは、いくつかの質問をするだけで、きみが誰のことを考えているのかを当てちゃうよ。実在の、または架空のキャラクターを想像してみて。アキネーターがずばり言い当てます。魔人に挑戦する勇気があるかな？\n\n**************** NEW: MyWorldを体験しよう！*****************\nアキネーターの躍進は止まらない！魔人からの新しいサプライズ、MyWorldを使って新しいゲーム方式を体験しよう。アキネーターにもっと挑戦してごらん。きみのMyWorldギャラリーの家族や友達も、魔人が言い当てるよ。もっと楽しく！アキネーターは、今までプレイされたことのないきみの家族や友達も当てちゃうよ。無理だって！？友達にきみのスマートフォンを渡して、MyWorldを体験させてあげて。びっくりさせちゃうよ！\n************************************************************\n\n特徴++\n－複数の言語が使用可能（日本語、英語、フランス語、中国語、韓国語、スペイン語、ポルトガル語、ドイツ語、アラビア語、ロシア語、イタリア語、トルコ語、ヘブライ語、オランダ語）\n－追加の背景（アキネーターin Japan）\n－プレイ結果をFacebookとTwitterでシェア\n－チャイルドフィルターでお子様のプレイも安心\n－iPadでも機能するユニヴァーサルヴァージョン\n\nFacebook上でアキネーターのファンになる: http://www.facebook.com/Akinator\nTwitterでアキネーターをフォローする: http://twitter.com/akinator_team\n\n注意事項：\n－アキネーターGenie App が、魔法のランプを使うにはインターネット接続が必要です。Wifiをオンにするか、データプランがあることを確認してください。\n－言語選択の際には、一覧をスクロールして使用言語を探してください。', '2011-12-09 01:42:42', '2014-06-02 15:01:23')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
Error - 2014-06-02 15:01:24 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('546278681', 'JP', 'jp.co.alc.kikutanadvanced', 'キクタン 【Advanced】 6000 ～聞いて覚える英単語～(アルク)', 'http://a1348.phobos.apple.com/us/r30/Purple/v4/cc/a4/d5/cca4d591-88ff-e09f-8cc7-c52c814e6cce/mzl.yngleljt.53x53-50.png', 'http://a1864.phobos.apple.com/us/r30/Purple/v4/cc/a4/d5/cca4d591-88ff-e09f-8cc7-c52c814e6cce/mzl.yngleljt.75x75-65.png', 'http://a1269.phobos.apple.com/us/r30/Purple/v4/cc/a4/d5/cca4d591-88ff-e09f-8cc7-c52c814e6cce/mzl.yngleljt.100x100-75.png', '400.00000', 'JPY', 'ALC PRESS, INC.', 'iOS_Apps', '6017', 'toppaidapplications', 0, '＜App Store教育1位獲得！＞\nご愛顧感謝セール\nキクタンAdvancedがご好評いただいているため、お客さまへの感謝をこめて、キクタンAdvancedを特別価格400円とし、引き続きご提供いたします。\n※セールは予告なく終了する場合がありますので、App Storeの価格表示をご確認の上ご購入ください。\n\n---------------------------------\n■シンプル！効率的！楽しい！「続く」英単語学習■\n・シリーズ累計250万部突破の「キクタン」アプリ版\n・【中級編】難関大学合格に必要な1120語を厳選！\n・通勤・通学中に活躍！スキマ時間に学習できる！\n\n「キクタン【Advanced】6000」は、語学出版社アルクの単語学習書「改訂版 キクタン【Advanced】6000」に収録の1,120語を、「フィルタリング学習法」で効率良く学習するiPhone/iPod, touch向けアプリです。書籍「キクタン」シリーズは、単語を「聞いて覚える」というコンセプトが支持され、シリーズ累計200万部を突破した単語学習書。このアプリでも聞いて覚える仕掛けが満載です。 \n\n※書籍「キクタン【Advanced】6000」は、2012年7月に改訂をし、収録語彙を選定し直しました。本アプリは、改訂版の単語を収録しています。\n\n◆試験に出る！日常会話で使える！単語選びに自信 \n入試問題とネイティブ会話の膨大な語彙データから割り出した必須英単語1,120を収録しています。1日16語×70日間で終了します。 \n\n本アプリに収録している語彙のレベル： \n大学：センター～難関大学 \n英検：準2～準1級 \nTOEIC：470～800点 \n\n語彙の選定にあたっては、語彙研究の成果であるコーパス(*1)のデータに、最新の入試問題のデータを加えて、徹底的に分析。単に入試を突破するだけでなく、日常生活で使える語彙を身に付けられます。社会人も学生も「この語彙を覚えれば必ず役立つ」という重要単語を網羅しています。 \n\n◆「フィルタリング学習法」で効率的に学習！ \n有料版「キクタン」アプリでは、苦手な単語を絞り込んで集中的に記憶する「フィルタリング学習法」で効率よく語彙力をアップできます。 \n\nステップ1：チェック \n単語を知っているか、知らないかフィルタリングします。 \n\nステップ2：詳細学習 \n「知らない」とフィルタリングした単語のみ、しっかり学習します。語義や関連語・派生語を覚え、フレーズや例文で用例を確認します。書籍に収録されていない例文音声も聞くことができます。 \n\nステップ3：テスト \n詳細学習した単語を3択問題でテストします。 \n\n復習： \nそれまでに学んだ単語のなかで、「知らない」とフィルタリングしたものをまとめて学習できます。それぞれの単語を1日後、3日後、7日後の忘れやすい時期に自動的に再学習するプログラムで、記憶の定着を助けます。 \n\n◆その他の便利な機能 \n・チャンツ \n書籍版で定評のある音楽のリズムに合わせて単語を覚える「チャンツ」を収録。「英語→日本語→英語→ポーズ」の順に収録されているので、音声のみでの学習も可能。通勤・通学時、電車の中の手ぶら学習にも便利です。 \n\n・単語リスト \n全単語リストのほか、単語帳に登録した単語リスト、「知らない」と分類して復習対象となった単語のリストを表示できます。 \n\n・検索 \n収録された単語の検索ができます。 \n\n・クロスワードパズル \n学んだ単語を使ったクロスワードパズルを搭載。息抜きにどうぞ！ \n\n・SNS連携 \nテストが終了すると、その結果をTwitterやFacebookを使って共有できます。ご自分の学習履歴を残すのにも役立ちます。 \n\n◆最新情報は「キクタン」アプリ専用サイトでお知らせしております。 \nhttp://www.alc.co.jp/kikutan_app/ \n\n◆「キクタン」シリーズラインナップ \n「キクタン」は本アプリの他、レベル別に全３アプリあります。 \n\nキクタン【Basic】4000： \n大学：センター～中堅私大 \n英検：3～2級 \nTOEIC：350～600点 \n\nキクタン【Advanced】6000： \n大学：センター～難関大学 \n英検：準2～準1級 \nTOEIC：470～800点 \n\nキクタン【Super】12000： \n大学：中堅私大～超難関大学 \n英検：準1級～1級 \nTOEIC：730点以上 \n\n◆無料アプリ「英単語パズル キクタンFree」 \nキクタンBasic、Advanced、Superの各アプリのクロスワードパズル機能を楽しむことができます。語彙力のレベルチェックにお役立てください。 \n\n◆本アプリのコンテンツ出典 \n「キクタン【Advanced】6000」（アルク刊） \n\n*1）コーパスとは：実際に話されたり書かれたりした言葉を大量に収集した「言語テキスト・データベース」のこと。コーパスを分析すると、どんな単語がどのくらいの頻度で使われるのか、といったことを客観的に調べられるので、辞書の編さんなどに活用されています。', '2012-09-28 06:47:46', '2014-06-02 15:01:24')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
Error - 2014-06-02 15:01:28 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('738256117', 'JP', 'com.digitalpublish.blackpsychology', '怖いほど相手の「本質」を見抜くブラック心理学', 'http://a1228.phobos.apple.com/us/r30/Purple6/v4/9f/cf/8a/9fcf8a52-fc00-ea67-c12d-65e8cd7a169e/mzl.bygkrtqi.53x53-50.png', 'http://a1744.phobos.apple.com/us/r30/Purple6/v4/9f/cf/8a/9fcf8a52-fc00-ea67-c12d-65e8cd7a169e/mzl.bygkrtqi.75x75-65.png', 'http://a1069.phobos.apple.com/us/r30/Purple6/v4/9f/cf/8a/9fcf8a52-fc00-ea67-c12d-65e8cd7a169e/mzl.bygkrtqi.100x100-75.png', '100.00000', 'JPY', 'kato hideki', 'iOS_Apps', '6018', 'toppaidapplications', 0, '◆◇有料App総合2位&ブックカテゴリ1位を獲得!!先着5000名様限定で90％オフ◇◆\n35,000DL突破を記念!!アプリ定価1,050円⇒【100円】\n\n◆大切な人の「本当の姿」知りたくありませんか？ \n\n「話すときによく鼻や顎をさわる」\n「座ると必ず貧乏揺すりをする」など……。 \n\n家族や友人、恋人や会社の上司や同期にこのような特徴的な行動をする人はいないでしょうか。 \n\n人間の行動は自分で認識できている部分は２割。\n他の８割は、無意識下にある深層心理の欲求や願望によって支配されていると言われています。 \n\n本書ではそんな何気ない癖や反射的な仕草から、相手の「本性」を見抜く方法を【ブラック心理学】と名付けました！\n\nこのブラック心理学を使い、相手の性格を見抜くコツはもちろん、さらにここぞ、と言うタイミングでブラック心理学のテクニックを利用し、相手の決断さえも揺るがしてしまう強い一押しが出来るようになる方法もお伝えします！ \n\n◆気になるの人の本音を見抜き、相手を「操る」コミュニケーション術を身につけられます！ \n\n●人の感情は「足」に出る！その理由とは？ \n●身体の部位から人の「本質」は見抜ける！ \n●商談をバシッと決める『シャルパンティエ効果』 \n●相手の心の距離を惹きつける『カタルシス効果』 \n●決断に迷うお客様の心掴んでビジネスを操る方法 \n●悪用厳禁！な心理学満載の恋愛テクニック \n\nなど……。 \nあなたも人間関係・恋愛を制して、「本音を話してもいいかも……」、「また会いたい！」そんな風に思われる人へなりませんか？\n\n【　目　次　】\n\n●１、人間関係、恋愛を制する人の資質とは\n・癖やしぐさに人の心理が表れる理由\n・身体の部位から「本質」を見抜く！\n\n●２、円満な人間関係を築く！ビジネス基礎編\n・警戒心レベル５\n・警戒心レベル４\n・警戒心レベル３\n・警戒心レベル２\n・警戒心レベル１\n\n●３、円滑に交渉を進めたい！ビジネス応用編\n・時間軸を超える会話術『エピソード記憶』\n・強い立場の人を味方に！『アンダードッグ効果』\n・口下手を利用する『ツァイガルニック効果』\n・商談を脱線させない『プリフレーム』\n・商談を決める『シャルパンティエ効果』\n・決断を迷う人に有効な『希少性の原理』\n・最後の一押し『フォールス・コンセンサス』\n・契約を結ぶ『ハード・トゥ・ゲット・テクニック』\n\n●４、良いパートナーをみつけたい！恋愛基礎編\n・恋愛ブラック心理学１～女性の仕草編～\n・恋愛ブラック心理学２～男性の仕草編～\n・恋愛ブラック心理学３～男女共通の仕草編～\n\n●５、相手に「一歩」踏み込みたい！恋愛応用編\n・第一印象で全て決まる『ハロー効果』\n・好印象をゲットする『ブラシーボ効果』\n・お願いを通すワザ１『フット・イン・ザ・ドア』\n・お願いを通すワザ２『ドア・イン・ザ・フェイス』\n・逆境を味方につける『カリギュラ効果』\n・日常生活でも大活躍！『ザイアンス効果』\n・確実に印象に残る『カクテルパーティー効果』\n・占い師が使うテクニック『バーナム効果』 \n・心の距離を惹きつける『カタルシス効果』\n\n●おわりに\n\n【　著　者　】\n\n行動心理学研究所', '2013-11-12 12:37:47', '2014-06-02 15:01:28')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
Error - 2014-06-02 15:01:29 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('529443604', 'JP', 'com.revivasoftworks.Snore-Lab', 'いびきラボ (SnoreLab)', 'http://a1520.phobos.apple.com/us/r30/Purple4/v4/73/52/d5/7352d538-30ba-7abe-0965-327c0704895a/mzl.lrdkpfmw.53x53-50.png', 'http://a388.phobos.apple.com/us/r30/Purple4/v4/73/52/d5/7352d538-30ba-7abe-0965-327c0704895a/mzl.lrdkpfmw.75x75-65.png', 'http://a1441.phobos.apple.com/us/r30/Purple4/v4/73/52/d5/7352d538-30ba-7abe-0965-327c0704895a/mzl.lrdkpfmw.100x100-75.png', '200.00000', 'JPY', 'Reviva Softworks Ltd', 'iOS_Apps', '6020', 'toppaidapplications', 0, 'iOSナンバー1のいびき分析アプリを使って、あなたのいびきを録音、測定、そして軽減しませんか。医師も推奨しています! \n\nいびきラボでは、音波分析を使っていびきを録音・測定することで、効果的ないびきの軽減方法が明らかになります。\n\n「このアプリは驚くべき発見です。これで初めて、自分のいびきをコントロールできると感じました。いびきラボありがとう!」\n\n「いびきラボは、これまで私が使った最高の睡眠レコーダーです。2週間少しでいびきが40パーセント以上減りました。」 \n\n▷ 30カ国で上位10位以内の医療アプリ \n▷ 33カ国で「What’s hot」として注目される医療アプリ \n▷ 「Lifehacker」、「Quantified Self」その他で特別記事掲載\n▷ 「HealthTap」で最高水準の米国の医師が推奨 \n\n特徴: \n▷ 高度ないびき検出アルゴリズム\n▷ いびきの音のサンプルを録音\n▷ いびきの強度を測定 (いびきスコア)\n▷ 睡眠統計を録音\n▷ 音ファイルをEメール送信\n▷ いつ、どのようにいびきが激しかったかを表示\n▷ 複数の夜間を通していびきの比較が可能\n▷ いびき対策の情報を提供\n▷ 試したいびき対策の効果についてテスト実施\n▷ アルコールなど、特別な要因によるいびきへの影響を表示\n▷ 容易な使用法、校正の必要なし\n▷ 100,000を上回るダウンロード数\n▷ 毎晩1,000以上の人々が使用!\n\nいびきラボは簡単で楽しく使え、洞察力に富み、強力な機能でいびきに悩む人々を支援します。多くのユーザーが、このアプリを使っていびきの軽減に成功したと報告しています。\n\nあなた、またはあなたのパートナーがいびきでお悩みなら、今日すぐにダウンロードしませんか! あなたのいびきスコアは?\n\nSnoreLabは、400名を超えるユーザーからのレビューで平均4.7星の評価を獲得しています。以下のような感想をいただいています: \n\n「このアプリは本当に素晴らしい。絶対に誰にでも必要だと思います:)」\n\n「驚くべき、役に立つアプリ- 私が寝ている間に何が起こっているのかがわかるようになりました」\n\n「このアプリは、機能的に役立つばかりでなく、簡単に使えるところがすごいです。健康増進に向けてシンプルで効果的なツールです。」\n\n「最高のアプリです。リストされているいびき対策をいくつか試して、いびきが減りました。私自身も妻も感謝します。特に妻が大変感謝しています!」\n\n「私は医師ですが... このプログラムは役に立ち、医師に相談する際に非常に便利なものです。」', '2012-10-26 11:18:40', '2014-06-02 15:01:29')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
