充実。 気象のエキスパート４００名が支えるお天気サイトの決定版です。\n ◆全２５チャンネルがあなたの生活を全力サポート\n 　▼ALL Ch.\n 　・今日明日週間の天気（天気予報、１０分天気予報）\n 　・気象災害対策Ch（地震、津波、台風、ゲリラ雷雨、警報注意報など）\n 　・専門気象Ch（雨雲レーダー、衛星、天気図、ライブカメラなど）\n 　・季節情報Ch（星空、さくら、花粉、花火、紅葉、スキー＆スノボ）\n 　・24時間生放送で天気を伝える動画番組Ch（SOLiVE24）\n◆スマートアラーム(通知サービス)\n 　スマートアラームの設定をONにしておくだけで、GPSによる位置情報をもとに、\n 　今いる場所の最新の気象情報を入手できます。\n 　 　(なお、バックグラウンドで位置情報(GPS)の利用は、バッテリーの消費量が大きくなる場合がありますのでご注意ください。)\n ◆ウェザーニュース会員（有料）登録について \n　スマートアラームやソラトモ機能など有料オプションの機能をご利用頂くには、「ウェザーニュース会員」（有料）をアプリケーション内でご購入手続きください。\n 　会員登録はご購入頂いた期間有効です。期間内に追加購入頂きますと、その期間分が加算されます。\n 　期間途中での解約に際し、返金は致しかねますのでご了承ください。\n 　自動更新にて、「ウェザーニュース会員」をご利用いただいている方へ\n - １ヶ月ごとの自動更新となります。\n - 月額 300 円です。\n - お支払いは iTunes よりご利用いただきます。\n - 現在有効期間満了の少なくとも24時間以上前に、自動更新を停止しない限り、自動的に更新されます。\n - ご購入後、[設定] - [iTunes Store/App Store] - [Apple ID] - [購読] の項目より、いつでも自動更新を停止していただくことができます。\n - 期間の途中で自動更新を停止していただいても、残りの有効期間については引き続きお使いいただけます。\n - 他のお支払い方法により、有効な期間が残存しているときに、新規に自動更新をご登録いただいた場合は、その残存期間については無効とさせていただきます。ご注意ください。', '2009-01-24 07:26:15', '2014-06-02 15:01:42')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
Error - 2014-06-02 15:01:44 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('657795287', 'JP', 'com.square-enix.dqxtools', 'ドラゴンクエストⅩ　冒険者のおでかけ便利ツール', 'http://a564.phobos.apple.com/us/r30/Purple/v4/da/01/30/da013058-4c10-e3f2-a433-7c51b77e73f5/mzl.ahuqhfny.53x53-50.png', 'http://a1080.phobos.apple.com/us/r30/Purple/v4/da/01/30/da013058-4c10-e3f2-a433-7c51b77e73f5/mzl.ahuqhfny.75x75-65.png', 'http://a805.phobos.apple.com/us/r30/Purple/v4/da/01/30/da013058-4c10-e3f2-a433-7c51b77e73f5/mzl.ahuqhfny.100x100-75.png', '0.00000', 'JPY', 'SQUARE ENIX INC', 'iOS_Apps', '6002', 'topgrossingapplications', 0, '================================\nドラゴンクエストⅩプレイヤー専用アプリです\n================================\n\n\n※※　はじめにご確認ください　※※ \nお使いの端末が以下のいずれかに当てはまる場合、アプリが正常に動作しない場合がございます。 \n\n・OSのバージョンが古い端末の場合\n・改造端末の場合\n・以下のような解析がされた端末の場合\n ---ソフトウェアの改造 \n ---ルート化等を含む解析\n ---リバースエンジニアリング\n ---逆コンパイル、または逆アセンブル　等\n\n\n【ご利用いただける機能】 \n『ドラゴンクエストⅩ』の世界をより一層お楽しみいただける『ドラゴンクエストⅩ　冒険者のおでかけ便利ツール』です！ \nこのアプリには、ゲームをしていないおでかけ先でも使える「ちょっと便利な機能」が搭載されています。 \n\n\n■キャラクター情報確認機能 \n自分のキャラクターの装備やパラメーターなどのプロフィール情報を確認できます。 \n\"サポート仲間雇われ情報\"やドラゴンクエストⅩ内でフレンド登録した相手キャラクターの状態が確認できる\"フレンド確認機能\"はもちろんのこと、その他にも、\"キャラクターの3D表示機能\"や、ドラゴンクエストⅩ内で所属しているチームの情報が確認できる\"チーム情報確認機能\"などの機能をお使いいただけます。 \n\n■郵便局機能 \n自分のフレンド宛てに手紙を送ることができます。また、郵便局に届いたお届け物も確認することができます。  \n\n■旅人バザー閲覧機能 \n「旅人バザー」に出品されているアイテムを条件をつけて検索したり、自分が出品しているアイテムの情報を確認することもできます。 \n\n■おしらせ確認機能 \nゲーム内での『ドラゴンクエストⅩ』運営スタッフからのお知らせを確認できます。\n\n■ライブカメラ \n「ドラゴンクエストⅩ」の世界がライブカメラ画像として映しだされます。画像は数十秒に一度更新されます。 \n\n■思い出アルバム \n「ドラゴンクエストⅩ」の世界で撮影した思い出アルバムの写真をおでかけ先で確認することができます。 \n\n\n■Ver2.0.1以降の新機能\n・チームクエスト閲覧機能の追加\n・元気チャージを元気玉に交換できる機能の追加\n・キャラクターの持ち物を確認できる機能の追加\n・ゴールド銀行からのゴールドの引き出し、預け入れができる機能の追加\n・郵便箱の手紙、アイテム、ゴールドを受け取る機能の追加\n・バザーの出品とりやめ機能の追加\n・プレミアムコンシェルジュ機能の追加\n\n\n≪プレミアムコンシェルジュについて≫\nプレミアムコンシェルジュでは以下のサービスがご利用いただけます。\n\n【こちらは有料のサービスになります】\n\n------------------------\n\n◆畑のお世話\nおでかけ便利ツール上から「ドラゴンクエストⅩ」内の畑に水をあげることができます。ご自身のキャラクター以外にフレンド、チームメンバー、自宅のご近所の方にも水をあげることができます。\n\n※畑のお世話機能に関しては「ドラゴンクエストⅩ」にログインした状態でもご利用いただけます。\n\n◆バザー落札\n旅人バザーに出品されているアイテムを、おでかけ便利ツールより落札することができます。\n\n◆バザー出品\n「ドラゴンクエストⅩ」内でお持ちのアイテムを、おでかけ便利ツール上から旅人バザーに出品することができます。\n\n◆元気玉をふくびき券に交換できるサービス\n「ドラゴンクエストⅩ」内でお持ちの元気玉・小元気玉・超元気玉を、元気玉の種類に応じた枚数のふくびき券に交換することができます。\n\n※ただし、一度に交換できるふくびき券は99枚です\n\n◆酒場サービス\nおでかけ便利ツール上からサポート仲間を雇うことができます。酒場サービスは町や村、キャンプ地、住宅村などフィールドやダンジョン以外の場所で「ドラゴンクエストⅩ」のゲームをログアウトしている場合にご利用いただけます。\n\n◆ふくびき所\nおでかけ便利ツール上から、「ドラゴンクエストⅩ」内でお持ちのふくびき券またはふくびき補助券を使用して、お好きな大陸のふくびき所をご利用いただけます。\n※「冒険者の便利ツール専用ふくびき所」もございます。\n\n------------------------\n\n\n≪ご注意≫\n\n※プレミアムコンシェルジュ機能をご利用の際には『ドラゴンクエストⅩ　冒険者のおでかけ便利ツール』上でのみ使用できる仮想通貨「ジェム」が必要となります。\n\n※ジェムはアプリ内のショップよりお買い求めいただけますが、初回サービスとして500ジェムをご利用のアカウント毎にプレゼントしております。また、毎日おでかけ便利ツールを起動するたびにもらえるデイリーボーナスもご用意しておりますので、無料でプレミアムコンシェルジュ機能をお使いいただくことも可能です。\n\n\n■お客様へのお願い\nお客様が「ドラゴンクエストⅩ」をよりお楽しみいただけるよう、本アプリの品質向上に努めておりますが、特定の端末でのみ発生する固有の不具合など原因調査が難しいものも多く、改善のためにお客様からの情報提供を必要としております。\n\nレビュー等の内容では原因特定に至らない場合も多いので、もし不具合が見つかりました際には、ぜひとも弊社サポートセンターまで詳細情報をご提供いただけますと幸いです。\n\n※アプリに関しての不具合やお問い合わせは\n　下記URLもしくはアプリ内からお問い合わせください。\n　スクウェア・エニックスサポートセンター\n　http://support.jp.square-enix.com/main.php?la=0&id=7901\n\n【使い方】 \n本アプリをご利用になるためには、「ドラゴンクエストⅩ　目覚めし五つの種族　オンライン」をオンラインモードでプレイしている「スクウェア・エニックス　アカウント」が必要です。 \n\nアプリを起動した後に、「はじめる」→「新しくキャラクターを登録」をお選びいただき、「スクウェア・エニックス　アカウント」を入力の上、「おでかけ便利ツール」に登録したいキャラクターを選択してください。 \n\n\n【ご注意】 \nおでかけ便利ツールに登録できるキャラクターは1キャラクターです。ただし複数キャラクターをお使いの方も、登録キャラクターを変更することで、おでかけ便利ツールをお使いいただけます。 \n　 \n登録しているキャラクターの変更をするためには、画面右上にある 「編集」ボタンを押し、キャラクター削除した後に再度キャラクター登録を行ってください。 \n\nまとめて複数キャラクターを登録しておきたい方のために、キャラクター登録チケットをアプリ内で販売いたします。一度このチケットをご購入いただければ、登録可能キャラクター数を最大限の10キャラクターまで増やせます。 \n\n【対応機種】 \niOS 5以上の機種 \n\n※OSのバージョンが古い場合、 \n　 正常に動作しない場合があります。 \n\n\n【非推奨機種】 \niPhone3GS \n\n※アプリが動かなくなった場合 \n　 バックグラウンドで起動しているアプリを \n　 完全に終了させて再度起動してください。 \n　 (操作方法についてはご使用の端末の \n　　マニュアル等をご参照ください。）', '2013-07-27 02:34:53', '2014-06-02 15:01:44')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
Error - 2014-06-02 15:01:45 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('524306589', 'JP', 'com.ekitan.EkitanTransit', '駅探 乗換案内（日本全国の時刻表、運行情報もご案内する無料のナビゲーションアプリです)', 'http://a730.phobos.apple.com/us/r30/Purple4/v4/4e/9b/78/4e9b789e-2d62-ba76-c3b4-824c7a29477c/mzl.xnxjjlvy.53x53-50.png', 'http://a1598.phobos.apple.com/us/r30/Purple4/v4/4e/9b/78/4e9b789e-2d62-ba76-c3b4-824c7a29477c/mzl.xnxjjlvy.75x75-65.png', 'http://a1595.phobos.apple.com/us/r30/Purple4/v4/4e/9b/78/4e9b789e-2d62-ba76-c3b4-824c7a29477c/mzl.xnxjjlvy.100x100-75.png', '0.00000', 'JPY', 'Ekitan', 'iOS_Apps', '6003', 'topgrossingapplications', 0, '「駅探乗換案内」は、無料で全国の乗換案内、時刻表、運行情報をご案内するアプリです。もちろんiPhone5・iPhone5s・iPhone5cにも対応。あなたのお出かけをナビゲートします。\n\n▼iOS7への対応について\n・iOS7に対応。デザイン・インターフェースを最適化しました。\n\n▼消費税率変更への対応について\n駅探 乗換案内は、2014年4月1日以降の消費税率変更後の運賃改定に対応しています。また、切符/ICカードの切替、ICカード利用時の1円単位運賃に対応済みです。\n\n▼有料会員の方へ\n・駅探アカウントでログインしてご利用ください。\n\n■基本機能\n\n乗換案内（終電・始発案内）\n・鉄道路線(新幹線をはじめとするJR、私鉄、地下鉄)、空路(飛行機)を含めたなど全国の駅を対象とした定番の乗り換え案内機能です。所要時間や運賃など簡単に検索できます。\n・駅から駅はもちろん、自宅やオフィスからの最適ルートもご案内。\n・「タイムビュー」機能で複数のルートを時間軸で比較できます。\n・1本前後の検索を標準搭載。\n・ホーム番号や、駅周辺の地図もご案内。\n・アラーム機能で、乗り遅れや乗り過ごしを防ぎます。\n・検索したルートは、メールで送信したり、LINEやtwitterで共有できます。\n・iPhoneの標準カレンダーへスケジュールとして登録できます。\n・検索結果は履歴からオフラインでも閲覧できます。\n\n時刻表\n・JR、私鉄、新幹線、地下鉄など全国の駅の時刻表を収録。\n・ダイヤ改正にも迅速に対応。常に最新のデータを反映します。\n・当駅始発かどうかも分かりやすくご案内\n・現在時刻からのカウントダウン表示も標準搭載。\n\n運行情報\n・鉄道路線について、リアルタイムに更新される最新の運行情報をお知らせ。\n・遅延、運転再開、振替輸送の状況など、全国の主要鉄道路線(新幹線、東京メトロなど)84事業者を網羅、しかも情報は、車内や駅の電光掲示板と同様の、鉄道事業者公式情報を中心にご案内します。\n・現在地の近くの路線は、自動的に探してご案内します。\n\nリポート\n・ユーザー同士で混雑状況をシェアする機能です。\n・運行情報とあわせて、リアルタイムの今の状況を把握できます。\n・「ありがとう！」ボタンで、リポートへの感謝を伝えましょう。\n\n■プレミアム機能(有料)について\n\nアプリ内でチケットの購入あるいは定期購読をいただきますと、便利なプレミアム機能がすべて利用できます。\n\n▼課金につきまして\n\n1.定期購読:300円(税込)/月\n定期購読を選択された場合、Auto Renewable Subscriptionによる1ヶ月間の自動継続となります。\n・有効期限の24時間以上前までに、自動更新を停止されない限り、自動的に定期購読が継続されます。\n・ご購入後、(App Storeのおすすめ最下部)の[Apple ID]-[購読]の項目より、いつでも自動更新を停止することが出来ます。(iTunes Storeからも同様の確認や自動更新の停止を行うことが出来ます)\n・アプリケーションからは自動更新を停止することは出来ません。\n・なお、自動更新を停止されても、有効期限までは引き続き、プレミアム機能をご利用頂けます。\n\n2.チケット\nチケットを選択された場合、ご購入から各チケットに設定されている期間の間(有効期限まで)ご利用いただけます。自動継続などはございません。\n・2013年12月9日時点、10日間100円(税込)/90日間600円(税込)/180日間1,200円(税込)/365日間2,200円(税込)の4種類がございます。\n\nいずれの場合も、チケットご購入後ないしは、定期購読開始後は、解約含めまして、一切の返金いたしかねますのでご了承下さい。\n\n▼追加されるサービスにつきまして\n\n①おまかせアドバイス\n・アプリがあなたに賢くアドバイスしてくれる機能です。\n・普段気がつかなかった乗り換え経路をご案内したり、普段使っている定期区間を検索することで同じ定期代でもう少し先の駅まで買える情報などをご案内します。\n【アドバイス例】\n　-「乗換を急げば早く着きます」（乗換案内）\n　-「1本後の列車に乗っても間にあいます」（乗換案内）\n　-「同じ料金でもっと遠くの駅まで買えます」（定期券）\n\n②マイデータ\n・よく使う駅や路線、ルートを保存。すばやくアクセスできます。\n\n③定期券\n・全国の定期料金を検索できます。\n・お手持ちの定期券を登録すると、乗換案内でも定期券を考慮した料金をご案内します。\n\n④徒歩ルート\n・駅からあるいは駅までの徒歩ルートを、地図上に表示してご案内します。急な出張やはじめて行く場所でも安心です。\n\n⑤迂回検索\n・遅延や運休が発生した場合でも、その路線を回避するルートをご案内します。突然のダイヤ乱れでも、目的地まで無事ご案内します。\n\n⑥乗車位置\n・次の駅での乗り換えが楽な車両や、改札に近い車両の乗車位置をご案内。\n\n⑦途中駅一覧\n・検索結果のルート上、すべての駅とその到着時間をご案内します。乗換案内の検索結果で、端末を横に傾けるだけで、すぐに途中駅をご覧いただけます。\n\n⑧列車時刻表\n・まるで紙の時刻表のように、前後の列車の時刻表を表示。\n・列車を選択してルートを再検索することもできます。\n・新幹線をはじめとして、旅行プランを練りたいときなど、比較をしたい場合に役立ちます。\n\n⑨一列車時刻表\n・列車単位で始発駅から終着駅までの発時刻、着時刻をすべて表示。\n・その列車が何駅から出発して、その駅に何時頃に到着するのか、また、何番線に着くのかなどが一覧で分かります。時刻表の検索結果で時刻を選択し、一列車時刻表を選択するだけです。\n\n■駅探アカウントでさらに便利に\n\nチケットを購入ないしは定期購読を開始された方は、本アプリで駅探アカウントを取得すると、スマートフォンサイト「駅探乗換案内」(http://sp.ekitan.com)の有料機能もあわせてご利用いただけます。\n\n■広告表示について\n\n無料状態でご利用の場合、広告が表示されます。\n有料会員状態では表示されません。\n\n【駅探アカウントを取得】\n\n※チケット購入後あるいは定期購読開始後に、駅探アカウントの取得をお願いします。\n\n・設定>アカウント設定>駅探アカウント「アカウント取得」\n\n【スマートフォンサイトでログイン】\n\n・ログイン>駅探アカウントでログイン\n\n　・iOS6以降に対応しています(推奨iOS7以降)。\n　　誠に勝手ながら、iOS4.0〜5.xのサポートはVer1.0.8で終了しました。\n　　(iOS6以降にアップデートの上、最新版をご利用ください)', '2012-10-19 16:00:00', '2014-06-02 15:01:45')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
Error - 2014-06-02 15:01:46 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('392604257', 'JP', 'jp.jra-van.JRASSApp', 'JRA-VAN競馬App', 'http://a672.phobos.apple.com/us/r30/Purple4/v4/a8/f0/4e/a8f04eb1-2ace-2d83-2f61-d5dfe6c66eab/mzl.nzwijwxf.53x53-50.png', 'http://a1188.phobos.apple.com/us/r30/Purple4/v4/a8/f0/4e/a8f04eb1-2ace-2d83-2f61-d5dfe6c66eab/mzl.nzwijwxf.75x75-65.png', 'http://a673.phobos.apple.com/us/r30/Purple4/v4/a8/f0/4e/a8f04eb1-2ace-2d83-2f61-d5dfe6c66eab/mzl.nzwijwxf.100x100-75.png', '0.00000', 'JPY', 'JRA SYSTEM SERVICE CO.,LTD.', 'iOS_Apps', '6004', 'topgrossingapplications', 0, '「JRA-VAN」がiPhoneアプリになりました。\n情報収集から予想、投票(IPAT連動)、レース動画まで、競馬を楽しむための充実した様々な機能をぜひ一度お試しください。\n\n■今回のバージョンアップ(Ver 1.12) \n・iOS7に対応しました。\n・iPhone5以降の縦長画面に対応しました。\n・開催日程画面のレスポンスを改善しました。\n・帯域増強のため 動画(レース/調教/パドック)の配信元 を変更しました。\n・その他、軽微な不具合事象を修正しました。\n\n■前回のバージョンアップ \n・パドック動画が視聴できるようになりました。\n・開催日のレース傾向を一覧表示する機能を追加しました。\n・記事/コラムに名勝負メモリアル、優駿連載コラム、顕彰馬コラムを追加しました。\n\n■情報内容・機能\n・出馬表(単勝オッズ/馬体重/過去5走)\n・オッズ\n・プロフィール(競走馬/騎手/調教師/繁殖馬/産駒/馬主/生産者)\n・IPAT連動機能\n・レース結果(払戻金/全馬着順)\n・レース動画\n・調教動画(重賞レース出走予定馬のみ)\n・データマイニング予想\n・データ分析(持ちタイム一覧/過去対戦成績/過去レース傾向)\n・データ検索(競走馬/騎手/調教師/繁殖馬/産駒/馬主/生産者)\n・本日の騎手/本日の騎乗馬\n・本日の結果一覧\n・各種ランキング\n・変更情報\n・記事/コラム\n・コース図/コース解説\n・血統系統図/血統解説\n・WIN5\n・お気に入り(レース/競走馬/騎手/調教師)\n・速報通知(メッセージ通知)\n・お楽しみコンテンツ(複コロゲーム、ウィナーズホースゲーム、プレゼント応募)\n など\n※レース動画はレース終了後約15分後から閲覧可能になります。\n※IPATでの投票はJRAのPAT会員(A-PAT会員または即PAT会員)様のみお使いになれます。\n※「複コロゲーム」「ウィナーズホースゲーム」等のお楽しみコンテンツは全てJRAシステムサービス株式会社の主催により行われるもので、Appleは一切関わりがありません。\n\n■料金\nアプリケーションは無料ですが、情報を閲覧するには、以下の料金がかかります(アプリ内課金)。\n\n土・日2日分\n(木曜出馬発表後-土曜日18時までの購入)  \n210円(税込):レース動画も見放題!\n\n日のみ(土曜日18時以降の購入)\n105円(税込):レース動画も見放題!\n\n4週間(購入日から4週間後まで)\n525円(税込):レース動画も見放題!\n\nレース動画のみの閲覧\n1レースあたり10円(税込)\n(購入日の翌々日24時まで閲覧可能)\n\n初回起動時にアンケートにご回答いただくと、4週間の無料お試し利用権が付与されます。\n\n※)アプリの再インストール等でチャージした金額が0になってしまった場合は、[設定]→[お問い合わせ]からサポートデスクにご連絡ください。履歴を確認してチャージ金額を復元いたします。\n\n■対応ハードウェア\niPhone(推奨:4以降)/iPod Touch(推奨:第3世代以降)\n\n■対応OS\niOS4/5/6/7\n\n■注意事項\n・本アプリケーションのご利用には、3G回線またはWi-Fiのインターネット接続が必要になります。', '2010-11-30 16:00:00', '2014-06-02 15:01:46')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
Error - 2014-06-02 15:01:48 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('443904275', 'JP', 'jp.naver.line', 'LINE', 'http://a1314.phobos.apple.com/us/r30/Purple/v4/35/65/3b/35653b8e-3478-dcb0-51bc-9083d3473566/mzl.ounkyxry.53x53-50.png', 'http://a1830.phobos.apple.com/us/r30/Purple/v4/35/65/3b/35653b8e-3478-dcb0-51bc-9083d3473566/mzl.ounkyxry.75x75-65.png', 'http://a1715.phobos.apple.com/us/r30/Purple/v4/35/65/3b/35653b8e-3478-dcb0-51bc-9083d3473566/mzl.ounkyxry.100x100-75.png', '0.00000', 'JPY', 'NAVER JAPAN', 'iOS_Apps', '6005', 'topgrossingapplications', 0, '無料通話・無料メールアプリの決定版\n\nLINEは、24時間、いつでも、どこでも、無料で好きなだけ通話やメールが楽しめる新しいコミュニケーションアプリです。\n\n世界231ヶ国、登録ユーザー数4億5千万人突破! \n\n日本、タイ、台湾、スペイン、中国、インドネシア、シンガポール、香港、マレーシア、インド、スイス、サウジアラビア、メキシコ、ロシア、マカオ、アラブ首長国連邦など、世界52ヶ国のApp Storeで無料1位を記録!\n\n\n【LINEの新機能】\n\n◆ビデオ通話\n遠く離れた家族や友人との会話やビジネスミーティングに便利な「ビデオ通話」ができるようになりました。\n\n◆Snap Movie\nその瞬間をひとコマ動画で撮影して、BGMもつけて共有できる「Snap Movie」機能を追加しました。\n\n\n【LINEの主な特徴 】 \n\n◆スマホ同士なら、いつでも、どこでも無料の音声＆ビデオ通話\n・クリアな音声品質で好きなだけ長電話をしても無料です。\n・国際電話ももちろん無料！ \n\n◆サクサク簡単すぐ届く無料メール \n友だちとメールがわりに、サークルの仲間とMLがわりに。テキストだけでなく、絵文字や写真、地図も送れます。 \n・気持ちが伝わるスタンプ・絵文字を搭載 \n・動画や音声メッセージも簡単送信可能 \n・PCにも対応 \n\n◆より楽しく・便利に コミュニケーション \nタイムラインで、テキスト・写真・動画・スタンプ・位置情報などを使って、自分の近況をアップしたり、友だちの投稿をチェックできます。\n\n◆「スタンプショップ」でお気に入りを見つけよう！\n世界の人気キャラクターや、ちょっと笑えるシュールなキャラクターなど、表情豊かなスタンプを購入できます。\n\n◆便利な情報が届く「LINE公式アカウント」 \n「友だち」に追加するだけで、国内外の人気有名人からのメッセージや、企業からのお得なお知らせ･クーポンなどが届きます。\n\n\n※パケット通信料金がかかりますのでパケット定額サービスへの加入をおすすめします。\n\n【推奨環境変更のお知らせ】 \nLINE最新バージョン（3.1.3）から、LINEの推奨環境が変わりました。 \n\n- iPhone 3GS 以上 \n- iOS 4.3 以上 \n\nアプリのバージョンアップまたはLINEの新規インストールは上記の推奨環境で行ってください。 \n\nなお、古いバージョンのiOSのままiPhoneを使っている方は、最新版へのOSのバージョンアップをおすすめします。 \n\n▼iOSのバージョンアップ方法はこちら \nhttp://mb.softbank.jp/mb/iphone/support/os_update/how_to_update/ \n（ソフトバンク・KDDIどちらも同じ方法です）', '2011-06-21 16:00:00', '2014-06-02 15:01:48')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
