ーディングダイエット)は、とにかく操作を減らし、入力をカンタンにしました。だから、記入したいときに記入でき、本当にわかりやすい家計簿です。 \n\n-------------------------- \n▼ 理由あって、シンプル\n------------------------- \n『おカネレコ』は、使ったときにササッと入れるために、サクッとアプリを立ち上げ、サクッと入れられる、そんなデザインをインターフェースの専門家がデザインしました。だから、2秒で入力が終わります。 \n\n家計簿アプリにありがちな難しい設定もありません。カンタンにはじめられて、カンタンに続けられる、そんなアプリです。 \n\n------------- \n▼ おカネレコの特徴 \n-------------\n1) 最初の設定がないから、すぐに始められる \n2) 使った時に電卓とカメラで２秒で出費入力* \n3) 出費データは見やすいグラフに反映 \n4) 出費カテゴリ（項目）のカスタマイズや削除が自由 \n5) 収入を入れると、収支バランスを計算してくれる \n\n------------- \n▼ こんな方にオススメ \n------------- \n・いろんな家計簿アプリ使ったけど、結局続かなかった方 \n・いつも家計簿はじめようと思うのだけど、手を付けられなかった方 \n・レシート取り込むのも面倒な方 \n・自分でズボラだなと思う方 \n・いつもお小遣いを使いすぎてしまう方\n\n------------- \n▼ おカネレコがさらに便利になる【プレミアムアップグレード】が登場 \n------------- \n「プレミアムアップグレード」すると、「おカネレコ」無料版がさらに便利に！「おカネレコ・プレミアム」と同じ便利機能が追加されます！\n※おカネレコ・プレミアムと全く同じ機能なので、有料版を利用したい場合はどちらか片方でかまいません。\n\n＜追加される機能＞\n・レシート撮影で読取り(金額,アイテム名,日時を自動読取り)\n・カテゴリのカスタマイズが90個まで可能に\n・Dropbox/Evernoteバックアップ機能\n・画面の配色を変更するテーマカラー変更機能\n・グラフの色変更機能\n・入力時に計算したいときに便利な電卓機能\n・Excelファイルに出力、パソコンに送信\n・画面下の広告が非表示に\n～まだまだ機能追加予定～\n\n※一度プレミアムアップグレードを購入し、アプリを再インストールされた方は[有料追加機能をリストア]を選ぶとプレミアムアップグレードされた状態に戻ります\n\n※まれにプレミアムアップグレードした際にアプリ停止し、プレミアムアップグレード状態にならない場合があります。その際は、「設定」「有料機能追加」「有料追加機能をリストア」を実行してください。\n\n\n-------------\n▼メディア掲載情報\n-------------\n\n□■日経新聞掲載■□\n[記事引用]「おカネレコ」は長続きするように、面倒な入力作業を極力減らした。初期設定は不要で、日々の入出金もカテゴリーを選んで金額を入力するだけ。入力したデータは、円グラフなどで自分の出費を確認できる。\n\n日経新聞（2013年4月4日号） \n\n□■産経新聞掲載■□\n[記事引用]面倒なことが嫌という人にお勧めなのが、操作がシンプルな「おかねレコ」（無料）。初期設定も必要なく、ダウンロードしてアプリを開いたらすぐに使える。入力を１画面に集約しているため、最低限の操作で入力が可能だ。\n\n産経新聞（2013年5月13日号） \n\n□■雑誌「an・an」掲載■□\n[記事引用]「給料日前はいつもピンチ」「月にいくら使っているか把握したい」というならこのアプリに勝るものなし！操作は出費のカテゴリを選ぶ→金額をタップ、で終了。これならズボラな人でも続きます！ \n\nマガジンハウス社「an・an」（No.1832, 2012年11月21日号） \n\n□■APPBANK掲載■□\nおカネレコーディングダイエット: 支出記録だけのシンプル家計簿。 \n円グラフでムダな出費が一目瞭然！無料。 \n\n[記事引用]本気の家計簿アプリは苦手ですが、 これくらいのライトな感覚の家計簿アプリな ら続けられるかもと感じました。ボタン類も とても使いやすく、苦手な家計簿アプリです。触っていて苦になりません。家計簿入力が \n苦手な方にこそ、ぜひ試していただきたいアプリです！ \n\nhttp://www.appbank.net/2012/09/14/iphone-application/476054.php \n------------- \n\n------------- \n▼こんな方にもオススメ \n------------- \n支出管理、zaim（ザイム）、かんたん家計簿、ReceReco（レシレコ）、マネーフォワード（moneyforward）、Dr.Wallet(ドクター・ウォレット)、レシーピ、excel（エクセル）などをご利用で、もっともカンタンな家計簿を探されている方にオススメです。\n\n------------- \n▼自社メディア\n-------------\n公式サイト：http://okane-reco.com/\n公式ブログ：http://ameblo.jp/okane-reco\nツイッター：https://twitter.com/okanereco/\n\n------------- \n▼ お問い合わせ・不具合の報告 \n------------- \nバグや機能改善を極力対応しておりますので、もし問題があった場合は、Appstoreのコメント欄ではご返答ができませんので、 feedback@smart-idea.jpまでお知らせいただくか、アプリの「設定」の「ご意見・ご要望」からフィードバックをお送りください。不具 合など極力対応しております。\n\n※お問い合わせ・ご質問・ご要望をたくさんいただいており、すべてお返事できないことがあります。不具合など緊急度の高いものには極力優先でお返事しております。\n\n※お問い合わせの際に、迷惑メールフィルターを設定されていて、回答を受け取ることができない方がいらっしゃいます。迷惑メールフィルターは「smart-idea.jp」をドメイン解除設定してお問い合わせいただけますよう、お願いします。', '2012-09-01 07:27:09', '2014-06-02 15:02:16')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
