ories, galleries from Getty Images, videos from the FIFA TV Studio and FIFA archives.\n\nExplore FIFA brings to life FIFA\'s passion for developing the game and building a better future. Travel through each journey to discover our worldwide projects, the people they reach and share incredible stories of the lives they change.\n\nDownload the official FIFA app and never miss a moment in football again!\n\nWant to find out more? See what FIFA Club members and other football fans say:\n\nwww.fifa.com/app\n\nwww.twitter.com/fifacom\n\nwww.facebook.com/fifa', '2013-11-27 23:18:53', '2014-06-02 15:02:48')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
