Error - 2014-06-02 15:03:05 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('441079429', 'JP', 'com.macropinch.cardiograph', 'カーディオグラフ (Cardiograph)：iPhoneやiPadのカメラを使った心拍数測定 - 家族や友達の心臓の健康状態を記録', 'http://a1009.phobos.apple.com/us/r30/Purple2/v4/cb/46/cf/cb46cf2b-cce9-ed84-6f24-d2d4bd4250a2/mzl.djzdetpw.53x53-50.png', 'http://a1525.phobos.apple.com/us/r30/Purple2/v4/cb/46/cf/cb46cf2b-cce9-ed84-6f24-d2d4bd4250a2/mzl.djzdetpw.75x75-65.png', 'http://a1970.phobos.apple.com/us/r30/Purple2/v4/cb/46/cf/cb46cf2b-cce9-ed84-6f24-d2d4bd4250a2/mzl.djzdetpw.100x100-75.png', '0.00000', 'JPY', 'MacroPinch Ltd.', 'iOS_Apps', '6013', 'topfreeipadapplications', 0, '「本日のアプリ」で今日だけ無料に！\n\n「本日のアプリ」をダウンロードして、24時間ごとに有料アプリを０円で手に入れよう！\n\n\nCardiograph(カルジオグラフ)は心拍数を記録するアプリケーションです。記録を後で見れるよう保存したり、個別のプロファイルで複数の人の計測結果を記録、メモや位置情報を追加、測定結果を印刷して共有または安全な場所に保管したりすることができます。\n\nCardiographはデバイスに搭載されたカメラで指先の写真を撮り、心拍リズムを算定します。これはプロの医療機器で使用されている方法です!\n\nこんなこと出来るとは。iPhoneの可能性を見せてくれました。\nJoeChein – *****\n\nいいですね‼ ほぼ正確!不整脈出ても計測出来たらもっといい!\nケイルン - ****\n\nちゃんとはかれてる。ご飯のあといつも同じくらい心拍数上がってると知りました\nとろろごはん – *****\n\nまさかと思って測ってみたら、びっくり!早速両親とかにも紹介したいです\nkこびぃ – *****\n\nとても面白いし、便利です。申し分ないです。\n小ばく - *****\n\n\n=== Cardiographを実際にご覧ください ===\nhttp://macropinch.com/cardiograph \nhttp://youtu.be/isIjcCFYEho\n\n\n• 心拍数の測定。\n心拍数の把握が今までよりずっと簡単になりました。外部ハードウェアを追加することなく、スマートフォンやタブレット搭載のカメラを使用し、ほぼ瞬時に正確な測定値を得ることができます。運動時やストレスのたまっている時、心臓関係の病気をお持ちの方、またはただ単に興味のある方など、心拍速度を把握することはとても便利です。\n\n• 結果をトラッキング。\n全ての測定結果は個人履歴に保存されるため、長期にわたり結果をトラッキングすることができます。測定結果の日付と時刻に加え、測定された位置の情報(地図表示可)やちょっとしたメモを追加することができ、記録を簡単に整理することができます。\n\n• 複数プロファイル。\nCardiographは複数の人がひとつのデバイスでアプリを共有している状況にも完全に対応しています。家族や友人一人ひとりにプロファイルを作成し、プロファイルごとに各自の測定履歴を記録できます。\n\n• エクスポート&印刷。\n各測定結果は詳細情報を省略することなく後でEメールで送信、またはウェブにアップロード可能なフォーマットにエクスポートしたり、アプリから直接印刷(AirPrint™互換プリンタが必要)することができます。§ 簡潔でわかりやすいデザインにより、すぐに慣れることができるため、複数の複雑な画面間を行ったり来たりすることなく、アプリを使うことに集中していただけます。\n\n• ユーザーガイド搭載。\nアプリの使用中にわからないことがあったり、全ての機能をフル活用したい場合、アプリ自体に搭載された接総合ヘルプマニュアルにアクセスすることができます。\n\n• iCloud® sync対応ユニバーサルアプリケーション。\nCardiographはユニバーサルアプリケーションです - iPhone、iPad、及びiPod touch で動作します。CardiographをiOS 5.0+の複数デバイスにインストールすると、全てのプロファイルと測定結果がシンクします!ひとつのデバイスでプロファイルや測定結果を管理すると、他のデバイスでも瞬時に変更が反映されます。\n\n注:デバイスにカメラ用フラッシュが搭載されていない場合、十分明るい環境(明るい日のあたる場所や光源の付近)で測定する必要があります。', '2011-08-04 08:26:45', '2014-06-02 15:03:04')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
