信期間により、配信が終了している場合がございます。\n※一部有料作品が含まれます。', '2008-08-13 10:23:46', '2014-06-02 15:03:12')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
Error - 2014-06-02 15:03:14 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('843003884', 'JP', 'jp.co.gakkonet.quizninjakanken', '漢字検定・漢検漢字トレーニング', 'http://a1088.phobos.apple.com/us/r30/Purple2/v4/40/5f/b8/405fb807-fb7a-ca87-6292-1e13cff65934/mzl.qkqzsjsv.53x53-50.png', 'http://a1956.phobos.apple.com/us/r30/Purple2/v4/40/5f/b8/405fb807-fb7a-ca87-6292-1e13cff65934/mzl.qkqzsjsv.75x75-65.png', 'http://a1489.phobos.apple.com/us/r30/Purple2/v4/40/5f/b8/405fb807-fb7a-ca87-6292-1e13cff65934/mzl.qkqzsjsv.100x100-75.png', '0.00000', 'JPY', 'Gakko Net Inc.', 'iOS_Apps', '6017', 'topfreeipadapplications', 0, '漢字検定・漢検対策アプリの決定版！\n漢字能力検定の6級、5級、4級、3級、準2級、2級、で出題される全1494漢字の書き取りを練習することができます。\n\nメニューは級ごとに分かれています。\n5問1セットの練習問題で漢字を練習し、10問1セットの実力テストで実力を確かめましょう！\n\nさらに、各級の漢字一覧表示機能を搭載。\n一覧から気になる漢字を選び、一文字ごとに読み、書き順、熟語を確認することができます。\n\n\n本アプリは無料です。\nアプリ内のすべての問題、すべての機能を無料でご利用頂けます。\n本アプリは広告ネットワークから配信を受け、広告を表示します。\n不具合を発見された方は、アプリ内のお問い合わせからご連絡を頂けますと幸いです。\n\nこのアプリを開発した学校ネット株式会社は、全国4000学校が利用する学習ウェブサイト「あしたね」を運営しています。また学習アプリ「はんぷく」学習シリーズは、累計400万ダウンロードを超える人気シリーズになっています。\n\n本ソフトウエアはパナソニックの手書き文字認識エンジン”楽ひら(R)”を利用しています。\n楽ひらはパナソニック株式会社の登録商標です。\n\n「漢字検定」・「漢検」は、公益財団法人 日本漢字能力検定協会の登録商標です。\n\n#漢検、漢字検定、漢字能力検定、漢字、はんぷく', '2014-04-24 07:56:10', '2014-06-02 15:03:14')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
