Error - 2014-06-02 15:04:03 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('373949388', 'JP', 'jp.co.microtech.eRokuyoHD', 'e六曜 HD', 'http://a1261.phobos.apple.com/us/r30/Purple/v4/20/3d/64/203d645f-ca9f-daf3-c9f1-237dfb1f17c4/mzl.evynwlpk.53x53-50.png', 'http://a1777.phobos.apple.com/us/r30/Purple/v4/20/3d/64/203d645f-ca9f-daf3-c9f1-237dfb1f17c4/mzl.evynwlpk.75x75-65.png', 'http://a1630.phobos.apple.com/us/r30/Purple/v4/20/3d/64/203d645f-ca9f-daf3-c9f1-237dfb1f17c4/mzl.evynwlpk.100x100-75.png', '100.00000', 'JPY', 'Microtech Corp.', 'iOS_Apps', '6012', 'toppaidipadapplications', 0, 'e六曜HDは「暦」を表示するカレンダーです。\n2009年から2030年までの詳しいカレンダーに対応しています。\n\n結婚式、結納の日取りを決めたいけど、大安、仏滅はいつ?\n納車、家の引渡し日は?\n引越はいつがいい?\n来年の連休、国民の休日は?\n満月はいつ?\n戌の日は?\n釣りに行くけど、潮の満ち引きは?\n新規事業をはじめるけど、天赦日はいつ?\n種まきするけど、一粒万倍日は?三伏日は?\n木を伐るけど、大つち・小つちは?\n\nなど、あなたの大切なシーンでお役立てください。\n\n【情報内容】\n・年月日\n・曜日\n・祝日\n・旧暦\n・六曜(大安、赤口、先勝、友引、先負、仏滅)\n・九星(一白、二黒、三碧、四緑、五黄、六白)\n・干支(子、丑、寅、卯、辰、巳、午、未、申、酉、戌、亥)\n・十支(甲、乙、丙、丁、戊、己、庚、辛、壬、癸)\n・二十四節気(立春、雨水、啓蟄、春分、清明、穀雨、立夏、小満、芒種、夏至、小暑、大暑、立秋…)\n・五節句(七草、ひなまつり、端午の節句、七夕、重陽)\n・雑節、行事(節分、バレンタインデー、八十八夜、彼岸、母の日、社日、蝋日、メーデー、七五三…)\n・暦日(八専、十方暮、天一天上、犯土の説、三伏日、三りんぼう、不成就日、天赦日、一粒万倍日)\n・月の満ち欠け(月齢、満月、新月、半月)\n・潮の満ち引き(大潮、中潮、小潮、長潮、若潮)\n・日の出、日の入り\n\n【機能紹介】\n・月間表示\n・日詳細表示\n・任意の年月への移動\n・今日へ移動\n・干支表示/非表示\n・旧暦表示/非表示\n・月間表示の色指定(10種類)\n・任意の日へのスタンプ機能(アイコン30種類)\n・バージョン情報表示\n\n【操作説明】\n●月間表示画面\n タイトルの\"月\"表示部分をタップすると、ピッカーを表示し、年月を変更することができます。\n\n●日表示画面\n 月表示の下のビューをタップするとその日の詳しい情報を表示します。\n スタンプを選択できます。\n\n●ツールバー\n 月表示するカレンダーの色(10種類)を選択できます。\n\nProduced by e-Workshop', '2010-06-06 05:45:33', '2014-06-02 15:04:02')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
Error - 2014-06-02 15:04:04 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('765224318', 'JP', 'net.7minworkoutapp.ipad', '7 分間エクササイズ (iPad) - 7 Minute Workout Challenge HD for iPad', 'http://a1512.phobos.apple.com/us/r30/Purple6/v4/aa/27/83/aa2783a4-25f6-16be-1ef0-125e68d990d5/mzl.mkfsfmoy.53x53-50.png', 'http://a28.phobos.apple.com/us/r30/Purple6/v4/aa/27/83/aa2783a4-25f6-16be-1ef0-125e68d990d5/mzl.mkfsfmoy.75x75-65.png', 'http://a825.phobos.apple.com/us/r30/Purple6/v4/aa/27/83/aa2783a4-25f6-16be-1ef0-125e68d990d5/mzl.mkfsfmoy.100x100-75.png', '300.00000', 'JPY', 'Fitness Guide Inc', 'iOS_Apps', '6013', 'toppaidipadapplications', 0, '「7 分間ワークアウト」はリサーチに基づいたワークアウトプログラムです。世界的なヒットを記録しています! \n\n論文誌 ACSM にも掲載され、ニューヨークタイムズによって人気を獲得した「7分間ワークアウト」はシンプルですが、効果的です。 \n\n30 秒間行うワークアウトを 10 秒間隔で行う 12 のエクササイズを研究者が厳選。休みを少なく入れた高集中トレーニングで、1 日のメタボリズムを高めることができ、7 分強の運動で、1 時間以上の運動量に匹敵する効果が得られます。 \n\n最も注目していただきたいのは、このエクササイズがとてもシンプルだという点です。特殊な機器は必要ありません。どこにいてもエクササイズできるのです! これで言い訳はできませんね。 \n\nこのアプリでは、研究によって裏付けられたワークアウトを行っていきます。効果を追跡し、ワークアウトを続けるうちにご褒美ももらえるようになっており、楽しく続けることができます。 \n\nアプリの機能: \n\n- おしゃれなデザイン \n- 男性と女性のトレーナーが、ビデオ、オーディオ、画像、テキストでエクササイズをご案内します \n- すべてのコンテンツが料金に含まれています (追加料金はかかりません。インターネット接続も必要ありません) \n- ウェイトトラッカーで体重を管理できます \n- アクティビティカレンダーでアクティビティを追跡できます \n- ワークアウトしながら、さまざまなアチーブメントをアンロックできます \n\n弊社はフィットネスのプロを集めアプリ開発を行っています。最高品質の製品をお届けすることに細心の注意を払っています。ご意見やご提案などは、お気軽にお寄せください。アプリは定期的に追加料金なしでアップデートしていただけます。', '2013-12-14 10:47:23', '2014-06-02 15:04:03')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
Error - 2014-06-02 15:04:04 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('793660476', 'JP', 'jp.co.spike-chunsoft.terrariajp', 'テラリア', 'http://a1941.phobos.apple.com/us/r30/Purple/v4/68/18/64/681864a9-65a7-2116-5e68-39eb4025ea59/mzl.ifscidpt.53x53-50.png', 'http://a457.phobos.apple.com/us/r30/Purple/v4/68/18/64/681864a9-65a7-2116-5e68-39eb4025ea59/mzl.ifscidpt.75x75-65.png', 'http://a1574.phobos.apple.com/us/r30/Purple/v4/68/18/64/681864a9-65a7-2116-5e68-39eb4025ea59/mzl.ifscidpt.100x100-75.png', '500.00000', 'JPY', 'Spike-Chunsoft CO, LTD.', 'iOS_Apps', '6014', 'toppaidipadapplications', 0, '！！！一部のポケットWiFiに端末を接続している場合、アプリが起動しないことがあるという現象が確認されています。アプリが起動しない場合、一度［機内モード］をオンにするなどして、ネットワークから切断して起動できるかどうかご確認ください。！！！ \n\n掘る、作る、戦う。遊びかたは無限大！\n\n2D横スクロール型モノづくりアクションアドベンチャー「テラリア」が、日本語に対応してiOSに登場！\n\nテラリアの世界は木や土、鉱石などのブロックで構成されており、ツルハシやオノなどを使って切り崩すことで、素材として収集できる。\n集めたブロックやモンスターが落とす素材などを使えば、アイテムを作ったり、自由な形の建造物を建てることが可能。\n新たな素材を求めて、そしてまだ見ぬ敵を求めて広大なマップを自由に散策しよう。\n\n・文字入力\n本アプリ内でのキャラクター名とワールド名の入力は、英数字にのみ対応しています。ご利用端末のキーボードをローマ字入力に切り替えて入力してください。\n\n・マルチプレイ\n本アプリは、最大4人のアドホックマルチプレイに対応しています。同じWi-Fiに接続した他のプレイヤーのワールドが、「ゲームに参加」画面に表示されます。\n\n 「テラリア」の世界をもっと知りたい方は、公式ウェブサイトをご確認ください。\n  http://www.spike-chunsoft.co.jp/terraria/app\n\nテラリアiOS版ユーザーサポート\n  support-terraria-ios@spike-chunsoft.co.jp\n※ゲームの攻略法に関するお問い合わせにはお答えいたしかねます。\n\n-------\n\nPublished by 505 Games (and Spike Chunsoft for Japan region). © 2014 Re-Logic. Mobile versions developed by Codeglue. All Rights Reserved.\n本ソフトウェアでは、フォントワークス株式会社のフォントを使用しています。フォントワークスの社名、フォントワークス、Fontworks、フォントの名称は、フォントワークス株式会社の商標または登録商標です。', '2014-05-27 16:00:00', '2014-06-02 15:04:04')" in /var/www/html/analozy/fuel/core/classes/database/pdo/