面にでてくるカメラボタンを押すだけの\n　簡単操作で毎回作ったハンバーガーは写真撮影\n　可能！端末のアルバムに保存することができ\n　ます。\n\n--------------------------------------------\n\n◆◇◆なりきり!!ごっこランドシリーズの特徴◆◇◆\n\n・対象年齢の子どもでテストプレイをしながら\n　つくりました。\n\n・2才児からでも遊べるように、直感的な操作に\n　しています。\n　わかりやすい音声ガイド、画面上の指マーク\n　もあります。\n　　\n・お子さまにわかりやすい達成感や自信を持た\n　せることができます。\n　随所に褒めるポイントがあり、ご両親がお子\n　さまを褒めたり励ましたりしてあげられます。\n\n・ごっこの工程の随所に、知育的な要素を\n　取りいれています。\n\n・見た目の質感や工程など、リアル感に\n　こだわりました。\n\n『なりきり!!ごっこエアラインへようこそ！』\nは、パパママとお子さまとで一緒に楽しんで\nいただけます。\nお子さまをひざの上に乗せて見てあげて下さい。\n\n--------------------------------------------\n・対象年齢：2才から', '2014-05-24 10:30:22', '2014-06-02 15:04:11')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
Error - 2014-06-02 15:04:13 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('369111608', 'JP', 'com.nagisa.ibunkohd', 'i文庫HD', 'http://a1990.phobos.apple.com/us/r30/Purple4/v4/21/8b/db/218bdbd3-aea5-05ee-99a1-cf37647e0399/mzl.qbthoava.53x53-50.png', 'http://a506.phobos.apple.com/us/r30/Purple4/v4/21/8b/db/218bdbd3-aea5-05ee-99a1-cf37647e0399/mzl.qbthoava.75x75-65.png', 'http://a1527.phobos.apple.com/us/r30/Purple4/v4/21/8b/db/218bdbd3-aea5-05ee-99a1-cf37647e0399/mzl.qbthoava.100x100-75.png', '800.00000', 'JPY', 'NagisaWorks, K.K.', 'iOS_Apps', '6018', 'toppaidipadapplications', 0, 'i文庫HDはiPadで小説や書類、漫画などを快適に読むためのアプリケーションです。\nまるで紙の本を読んでいるかのようなインターフェイスにより、リアルで快適な読書を楽しめます。\niPadで文学作品を楽しみたい方・PDFの書類や資料を読みたい方・電子化した書籍を読みたい方にお勧めします！\n\n2010年度グッドデザイン賞受賞\niTunes Rewind 2010 にて日本AppStoreトップ有料1位・トップセールス1位を獲得\n\n日本語を快適に読むために\n・横書き(左開き)だけでなく、小説や漫画を読むのに重要な縦書き(右開き)に対応。\n・PDFに綴じ方向の指定がある場合、自動的に認識します。\n\n見開き表示とページエフェクト\n・横画面で表示すると2ページを見開きとして表示します。横長画像のページは自動的に見開きとして扱います。\n・ページを「めくる」ことができるので、紙の本と同じように読むことができます。\n\nおすすめ書籍の紹介\n・人気の作品や著名な作品などを「おすすめ」本棚に予め登録しておきました。読む本を選ぶときにぜひ参考にしてみてください。\n\n青空文庫について\n・著作権の失効した作品を公開している「青空文庫」から、書籍を簡単な操作でダウンロードして読むことができます。\n・太宰治「人間失格」、夏目漱石「こころ」、宮沢賢治「銀河鉄道の夜」、吉川英治「宮本武蔵」、堀辰雄「風立ちぬ」、柳田国男「遠野物語」など、たくさんの名作を快適に読むことができます。\n・ダウンロードを行なっておけば、インターネットに接続できない状況でも読書を楽しめます。\n・青空文庫の新着書籍もアプリケーション内から「更新」ボタンをタップするだけで一覧を取得するので、簡単にダウンロードして読み始められます。\n\n「本棚」機能\n・本棚を自由に作成することができます。\n・本棚には表紙の画像が並ぶので、蔵書を眺めて一冊選んで読む…という操作をスムーズに行えます。\n\n「しおり」機能\n・何枚でもしおりを挟むことができます。また、メモを書くことも可能です。\n・文字列を選択して「しおり」とすることで、選択した文章にマーカーをひくことができます。\n・しおりの内容は Evernote に転送することができます。読書メモとしてしおりを活用すれば、Evernoteに読書ノートができあがります。\n\nスキャナを使って作成したデータの閲覧\n・スキャンして作成した画像ファイルやPDFファイルもi文庫HDで楽しむことができます。軽快な動作に加え、右/左開き設定・見開き表示機能などの様々な機能が快適な読書をサポートします。\n・ScanSnapの公式サイト内で「ScanSnap＋iPad連携」としてi文庫HDを挙げていただきました！\n\n対応ファイル形式\n・i文庫HDは以下のファイル形式を書籍として扱います。\n.txt, .pdf\n.zip, .rar (中身は.txt および.jpg/.png ファイル)\n\nファイル転送\n・iTunesの「ファイル共有」機能によるUSB転送のほか、Dropbox, SkyDrive, Google Drive, Box, pogoplug, SugarSync に対応。他にWebDAV, FTPサーバからのファイルダウンロードにも対応しています。\n\nPDF内のデータを活用\n・ファイル内の目次情報や、ページ上のハイパーリンクに対応。\n・文字の選択・検索も可能です(テキストデータを含む場合)。\n・文字選択は日本語の単語を選択しやすいよう、独自の処理を行なって快適さを実現しています。\n\n余白を取り除いて限られたiPadの画面サイズでも読みやすく\n・ページにある余白を取り除いて表示することができます。内容を画面いっぱいに広げて表示するので、読みやすさが向上します。\n\nサムネイル機能で読みたいページを素早く見つける\n・ページのサムネイルを画面下部または画面全体に並べて表示します。\n・しおりが挟まっているページには印がつきます。また、しおりの挟まっているページのみをサムネイル表示することも可能です。\n\n少し別のページを見て、また戻る\n・サムネイルやしおりを選んでページを移動したあと、もといたページにボタン1つで戻ることができます。\n\n辞書をひいて言葉の意味を知る\n・iPad内蔵の国語辞書や英和・和英辞書などをお使いいただけます。 URLスキーム対応の辞書Appをお持ちの場合、そちらもご活用いただけます。\n・文字列を選択してボタンをタップするだけで言葉の意味を調べられます。テキストデータを含むPDFでも同様に単語を調べることができます。\n\nBluetoothキーボード対応\n・対応機器を使用することで、画面に触れることなく読み進めることができます。\n\nスライドショー・読み上げ\n・スライドショーモードによって一定時間ごとに自動でページをめくります。\n・読み上げ機能では読み上げ部分をハイライト＆ページ自動めくりを行いながら文章を読み上げます。読み上げにはiOS搭載のものを使用しています。\n\nパスコードロック機能\n・指定の本棚と転送したファイルの格納先である「フォルダ」画面にパスコードロックを設定することができます。ビジネス用の資料など、表示に制限を設けたいファイルをご使用の場合、この機能を試してみてください。\n\n豊富な設定項目\n・ページをめくるときのエフェクトをオフにしたり、タップ操作を行う位置を変えたりと、表示や操作を柔軟に設定することができます。\n・お好みに合わせてi文庫HDをカスタマイズしてください！\n\nこの他にもたくさんの便利な機能・設定が用意されています。\n更に詳しい情報はi文庫HDのWebページで！\nnagisaworks.com/ibunkohd', '2010-05-10 01:03:42', '2014-06-02 15:04:13')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
Error - 2014-06-02 15:04:15 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('593042008', 'JP', 'com.teamlabbody', 'teamLabBody-3D Motion Human Anatomy-', 'http://a15.phobos.apple.com/us/r30/Purple4/v4/5f/17/e4/5f17e477-2012-1142-b341-5a7c862ebce1/mzl.fwmsncys.53x53-50.png', 'http://a531.phobos.apple.com/us/r30/Purple4/v4/5f/17/e4/5f17e477-2012-1142-b341-5a7c862ebce1/mzl.fwmsncys.75x75-65.png', 'http://a848.phobos.apple.com/us/r30/Purple4/v4/5f/17/e4/5f17e477-2012-1142-b341-5a7c862ebce1/mzl.fwmsncys.100x100-75.png', '3000.00000', 'JPY', 'TEAMLABBODY.inc', 'iOS_Apps', '6020', 'toppaidipadapplications', 0, 'teamLabBody-3D Motion Human Anatomy-は、世界で初めて、生きた人間の動き・形態を再現した3D人体解剖学アプリです。\n＊iPad2、新型iPad、iPad4、iPad miniに対応（iPad1には非対応）\n＊日本語と英語に対応\n\n-特徴-\n●世界で初めて、献体とは異なる生きた人間の関節の動きを３Ｄで再現\n骨格の動き・形態を好きな角度・倍率で閲覧できます\n\n●ＣＴやＭＲＩのデータから忠実に再現された３Ｄ人体模型\n忠実に再現された全身の筋肉・じん帯・神経・血管・骨が閲覧できます\n総対象部位数は827部位\n＊内臓と脳は含まれておりません\n\n●全身表示から直感的に操作\n全身表示の状態から見たい部分だけを自由に見れるので、非常に理解しやすく、人体解剖の学習・患者様への説明に役立ちます\n\n●1000近くの対象部位を即座に検索・表示\n検索した部位名を即座に表示し、詳細説明を閲覧できます\n\n-開発ストーリー-\n大阪大学運動器バイオマテリアル学、整形外科教授の菅本一臣の研究チームは、整形外科疾患の治療過程で世界で初めて、生きた人間の関節の三次元的な動きを解析する手法を1998年に開発。\nそこで、人間が自分の意思で動かした関節の動きは、従来の医学教科書に記載されている献体を用いた動きとは異なることを明らかにした。\n20-30名の研究協力者を募り、生きている人間で10年以上にわたり、全ての関節の形態や動きをCTやMRIで撮影し、静止イメージ画像をコンピュータプログラミングによって解析した上で、全身の筋肉・神経・血管・骨・関節をビジュアル化した。\n\n-利用シーン-\nteamLabBodyは、医療を学ぶ学生をはじめ、整形外科医・理学療法士・作業療法士・鍼灸師・柔道整復師・トレーナーなど人体と密接に関わる仕事をされる方々に幅広く利用して頂けます。\n\n●実用的な人体解剖学・運動学的知識を習得できます\nteamLabBodyは、生きた人間の動き・形態を3Dで閲覧し、詳細説明を読むことができます。人体解剖・運動学的知識の習得に役立ちます。\n\n●臨床（診療・治療計画立案等）や実際の手術計画に役立ちます\n整形外科医、理学療法士および作業療法士の方は、臨床（診療・治療計画立案等）に役立たせることができます。\nまた、筋肉だけでなく、筋肉の後ろにある大事な神経の存在等を簡単に把握できるため、実際の手術計画等にも役立ちます。オフラインで使用できるので、端末機器に清潔処理を施せば、術中活用も可能となります。\n\n●診療の際、患者様に分かりやすく説明できます\n操作方法が簡単で、3Dで閲覧でき一般の方にも非常に理解しやすいため、診療時の患者様への説明を分かりやすく行うことができます。\n\n\n-機能-\n●3D人体解剖図モード\n　・筋肉/じん帯/神経/血管/骨をそれぞれ表示/半透明/非表示で切り替え\n　・表面から段階的に表示/非表示をスライドバーで切り替え\n　・選択した部位をひとつずつ表示/半透明/非表示で切り替え\n　・検索（部位名、部位名の詳細説明、検索履歴から検索）\n　・お気に入り登録\n　・部位の詳細説明にメモの追加\n　・画面キャプチャの印刷\n　・半身切り替え（筋肉/じん帯/神経/血管をの表示を右半身/左半身で切り替え）\n\n●骨格モーションモード\n　・主要な関節の動きを閲覧\n　＊各関節の動きは複数パターン閲覧できます', '2013-03-20 23:56:45', '2014-06-02 15:04:15')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
