Phone5/iPhone4S/iPhone4/iPhone3GS/iPad(第3世代)/iPad2/iPadで検証しています。\n- 登録できるファイルは以下の通りです。\n1)netprintアプリからの登録の場合:\n画像ファイル(JPEG、PNG)、テキスト入力、Webページ\n2)メール送信による登録の場合:\nメール本文(プレーンテキスト、HTML)、Windows日本語版Microsoft Office2007/2010(RTF形式含む)、PDF1.3-1.7、DocuWorks3.0以降の文書、XPS、マルチページTIFF、JPEG、PNG、TXT、HTML\n3)他アプリからnetprintアプリを呼び出して登録の場合:\nPDF1.3-1.7、DocuWorks3.0以降の文書、JPEG、PNG、Windows日本語版Microsoft Office 2007/2010\n※Mac版Microsoft Officeには対応しておりません。\n- 本サービスは、日本国内のセブン-イレブン店舗のマルチコピー機でのみプリント可能です。\n- サービス時間帯は24時間365日です。ただし、月1回メンテナンスがあります。(アプリのお知らせで事前に通知)\n- プリントするときに、以下のプリント料金をお支払いいただきます。\n(すべて1枚当たりの金額です。)\n白黒(B5/A4/B4/A3サイズ):20円\nカラー(B5/A4/B4サイズ):60円\nカラー(A3サイズ):100円\nカラー(Lサイズフォト用紙):30円\n- その他、詳細はアプリインストール後の[ご利用方法]サイトをご確認ください。', '2010-06-07 16:00:00', '2014-06-02 15:04:23')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
