Error - 2014-06-02 15:05:23 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('372332300', 'JP', 'jp.co.sankei-digital.YOPViewer.hd', '産経新聞HD', 'http://a1792.phobos.apple.com/us/r30/Purple/v4/ab/38/5e/ab385e57-7928-7d9f-39d9-a9d7562e1725/mzl.icgvolhy.53x53-50.png', 'http://a308.phobos.apple.com/us/r30/Purple/v4/ab/38/5e/ab385e57-7928-7d9f-39d9-a9d7562e1725/mzl.icgvolhy.75x75-65.png', 'http://a145.phobos.apple.com/us/r30/Purple/v4/ab/38/5e/ab385e57-7928-7d9f-39d9-a9d7562e1725/mzl.icgvolhy.100x100-75.png', '0.00000', 'JPY', '株式会社産経デジタル', 'iOS_Apps', '6009', 'topgrossingipadapplications', 0, '【美しい紙面画像】\n産経新聞などの紙面を、新聞そのままの体裁で、かつiPadならではの高精細な画面で、美しくご覧いただけるのが「産経新聞HD」です。\n\n【3カ月のバックナンバー＆切り抜き】\n過去3カ月分のバックナンバーもご利用いただけるほか、記事を切り抜いてアプリ内の「スクラップ帳」に保存することができます。\n\n【購読料】※4月1日以降も同額です\n購読料金は次のとおり(いずれも1カ月/自動更新型です)。\n\n・産経新聞(朝夕刊セット) 1,500円\n・フジサンケイビジネスアイ 900円\n・夕刊フジ 900円\n・SANKEI EXPRESS 900円\n\n▼産経朝刊は東京版、夕刊は大阪版となります\n▼産経新聞号外は、無料でご覧いただけます\n\n【1面だけなら無料】\nアプリケーションのインストールは無料。それぞれの一面だけでしたら毎日無料でご覧いただけます。\n\n【Appleの定期購読機能を使用】\n▼購読はAppleの自動更新型になっています\n▼月末月初にかかわらず、購読手続きをされた日から翌月の同日までの購読期間となり、これが自動的に更新されます\n\n▼最新紙面を取得しない場合は、「ストア」画面に戻ってください。あるいは「ストア」画面左上の「更新」ボタン(丸まった矢印のボタン)をタップしてください。\n\n▼いずれも自動更新の定期購読型課金です。お客さまご自身でApp Storeを通じて自動更新をキャンセルされない限り、課金は継続しますのでご注意ください。\n▼すでに購入済みなのに再度課金を求められる方は、アプリ右上の「メニュー」>「購読を復元」をタップして、「復元」処理を行なってください\n\n\n【特徴】\n・紙の新聞そのままのレイアウトで読めます。(一部、ご覧いただけない記事、ページもあります。ご了承ください)朝刊は毎朝午前5時、夕刊は午後5時をめどに新聞データを準備します。激虎につきましては、原則毎週水曜日の午前5時過ぎとなります(あくまで目安になります)。\n\n・全紙面のデータをダウンロードした後は、通信環境のない場所でも新聞を読めます(必ず全データを取得しておいてください。未取得データは、通信環境のない場所ではごらんいただけません。バックナンバーは、その都度紙面データを取得しますので、必ず通信環境下でお願いします)。\n\n・過去3カ月分のバックナンバーが読めます。\n\n・ダブルタップで段階的に拡大しますので、ピンチアウト、ピンチインでお好みのサイズに調整してください。2本の指で同時に画面をタップすると1段階ずつ縮小します。\n\n・ページをめくるには、左右端をタップしたり、ページをフリックして(指ではじいて)ください。\n\n・長押しにより記事の切り抜きができます。\n\n【ご利用環境等について】\n・紙面データのダウンロードは、3G/LTE回線でもできますが、Wi-Fi環境で行うことを推奨します。バックナンバー取得時も同様です。\n\n・アプリのバージョンをアップしたり、アプリを削除すると新聞データもなくなります。アップデート後は、通信の安定している場所で、再度紙面データを取得してください。\n\n・購読期間中は、なんらかの理由でアプリを削除されても、紙面購読の権利は継続されていますのでご注意ください。\n\n【休刊日等について】\n新聞の発行がない日は、更新はありません。夕刊フジは日曜のほか祝日や年末年始もお休みです。ご了承ください。', '2010-05-27 16:00:00', '2014-06-02 15:05:23')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
Error - 2014-06-02 15:05:24 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('551921916', 'JP', 'jp.co.incrementp.MapFanPlus', 'MapFan＋ (地図・ナビ・渋滞)', 'http://a583.phobos.apple.com/us/r30/Purple4/v4/08/8b/ba/088bbab6-1d66-316b-4005-4972e37946e6/mzl.psxathgc.53x53-50.png', 'http://a1099.phobos.apple.com/us/r30/Purple4/v4/08/8b/ba/088bbab6-1d66-316b-4005-4972e37946e6/mzl.psxathgc.75x75-65.png', 'http://a648.phobos.apple.com/us/r30/Purple4/v4/08/8b/ba/088bbab6-1d66-316b-4005-4972e37946e6/mzl.psxathgc.100x100-75.png', '0.00000', 'JPY', 'INCREMENT P CORPORATION', 'iOS_Apps', '6010', 'topgrossingipadapplications', 0, 'オンライン地図、検索、音声ガイド付きカーナビまで、本格地図ナビアプリの基本機能がすべて無料\n【MapFan for iPhoneアプリ移行キャンペーン中】\n年間有料オプションをお得な価格でご提供！\n\n ---------------------------------------- \n【MapFan＋(マップファンプラス)の特徴】  \n◇美しく見やすい地図は、オンラインとオフラインのハイブリッド表示！  \n有料オプションチケットで、地図をダウンロードしてオフラインで表示可能！  \nボタン切り換えで、常にサーバー上で更新されるオンライン地図と、非通信時にも表示できるオフライン地図の両方を、シーンに合わせて使い分けできます。 \n ※画面右上のボタンをタップし「OFFLINE（白色）」にすると表示されます。  \n※最初は「ONLINE（青色）」になっています。   ◇オフライン地図は常時通信を行わないので、圏外でも安心して地図を見ることができます。  \nまた現在地表示や地図スクロールも素早く軽快です。  \nルート検索結果をあらかじめブックマークしておけば、通信の繋がらない場所でもナビとして利用可能です。  \n電波状態の悪い地域にお出かけの際のナビゲーションや災害時の帰宅ルート確認にもお役立ていただけます。\n\n   ◇リアルタイムに更新される交通規制・渋滞情報、ガソリン価格、駐車場の満車/空車情報、TVで紹介されたスポットなど、お出かけ時に欲しいコンテンツを利用できる、有料オプションプランもご用意しています。\nオプションプランでは、すべてのコンテンツを有効期間内ご利用可能です。   \n\n◇無料で使える、ルート検索・本格ナビ  有料道利用の有無や条件設定で好みのルートを検索可能。\n施設検索結果から「ここへ行く」で簡単にルート検索することもできます。  \nルート案内（ナビ）は、音声案内はもちろん、交差点名表示やレーン案内表示、方面看板表示まで可能で、高速道路ではSA/PA内の設備情報も表示されます。 \n\n  ◇iPadの最適化表示に対応。iPhoneとiPadなど複数端末で利用可能！   \n\n◇iCloud利用による複数端末間でのブックマークの共有も可能です。有料機能も1端末でチケットを購入すれば複数端末で利用できます。  \n---------------------------------------- \n【オフライン地図について】  \n◆一度ダウンロードした地図データは、データを削除しない限り、チケットの有効期間が過ぎてもそのままご利用いただけます。   \n◆ダウンロードした地図データは端末内に保存され、iTunesやiCloudにはバックアップされませんので、アプリの削除や地図データの削除、端末の復元を行った場合、再度データのダウンロードが必要になります。   \n◆関西のみ、関東のみ、など必要な地域だけを分割してダウンロード出来るので、全国一括に比べ短時間でのダウンロードが可能、また端末内のストレージ使用量も節約できます。   \n◆オフライン地図も更新  ダウンロード用オフライン地図データは、年4回程度の更新を予定しています。  \n---------------------------------------- \n【外部連携仕様無料公開】  製品サイト（www.mapfan.com/iphone/plus/）にて、MapFan＋を外部のアプリやサイトから呼び出すための外部連携仕様（URLスキーム）を公開しています。  個人法人問わず、無料でご利用いただけますので、ぜひご活用ください。  \n ---------------------------------------- \n 【主な搭載機能】\n  ＜無料機能＞  \n・現在地表示 \n ・追従  \n・地図の拡大・縮小、スクロール、地図回転  \n・ルート検索、ナビゲーション機能　\n※1  (車ルート/簡易歩行者・自転車ルート)  \n・音声案内、レーン情報\n・方面看板等の誘導情報  \n・オートリルート、到着予想時刻表示  \n・Twitter/Facebook/メール/メッセージでの位置情報のシェア  ・ブックマークのフォルダ管理/編集、ブックマークのiCloud同期、履歴(スポット/ルート) \n ・フリーワード検索(スポット/住所/TEL/〒)\n  ・周辺検索、住所一覧検索 \n・横画面対応、iPad最適化対応   \n\n【有料オプションプラン】 \n・渋滞情報/渋滞考慮ルート検索  \n・駐車場満空情報、ガソリン価格情報、TV紹介スポット情報 \n ・オフライン地図データダウンロード   \n※1.簡易歩行者・自転車ルートの表示は、歩行者向け、自転車向けの道路情報を含んでいないため、あくまでも参考表示となります。ご利用の際はご注意下さい。なお、音声案内は行いません。 \n ※2.有料オプションプランのご利用には、自動更新購読または期間チケットの購入が必要です。  \n----------------------------------------\n◆動作環境　\n・iOS 6.0～7.1.0\n ・iPhone 4, 4s, 5, 5s, 5c\n・iPad 2, iPad 3rd, 4th, iPad mini, iPad Air,  iPad mini Retina\n ・iPod touch 4th, 5th  \n・約65MBの空き容量(アプリサイズ:約32MB)  \n※オフライン地図データのダウンロードには、Wi-Fi環境が必要です。  \n----------------------------------------\n ◆有料オプションプランについて\n・自動更新購読1ヶ月コース：400円/月\n※こちらのコースはApp Storeの自動更新購読（Auto Renewable Subscriptions）を利用しています。\n料金は、ご利用のiTunesアカウントに課金され、有料オプションプランがご利用いただけます。\n※自動更新される際、有効期限終了の24時間前から終了までの間に課金されます。1ヶ月の料金は400円です。\n※有効期限の24時間以上前に、設定から自動更新をオフすると、停止することができます。\n※自動更新の停止/再設定方法\n端末本体の「設定」＞「iTunes & App Store」＞「AppleID」＞「Apple IDを表示」からログイン＞購読の「管理」をタップして、「自動更新」の設定を変更することで停止・再購入が行えます。\n※当月分のキャンセルについて\n有料オプションプランの当月分のキャンセルについては受け付けておりません。\n\n-------------------\n・期間チケット\n利用期間に応じ、以下の3つのコースを選択できます。\n90日：900円\n180日：1,800円\n365日：3,000円\n----------------------------------------\n◆注意事項  \n・ルート検索結果及び誘導情報は、あくまでも参考情報です。実際の道路状況や交通規制に従ってご利用ください。 \n ・移動中の運転者または歩行者による携帯電話の操作/注視は大変危険ですので絶対にお止めください。必ず安全な場所に停止してから操作してください。  \n・本アプリは、GPSを利用して常に現在位置を取得しているため、電力を多く消費しますのでご注意ください。  \n・iPod touch 、iPadのWi-Fi専用モデルについては、自車位置取得精度が低いためナビゲーションのご利用については推奨しておりません。   \n\n◆MapFan公式Twitterアカウント◆ \n ＠MapFan_iPC   \n\n◆MapFan公式Facebookファンページ◆  \nhttps://www.facebook.com/MapFanOfficial', '2012-11-19 15:37:03', '2014-06-02 15:05:24')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
